{"date_startDate": "2018-11-21", "date_endDate": "2019-03-11", "time_startTime": "None", "time_endTime": "None", "location_address": "250 S. Grand Ave.", "location_city": "Los Angeles", "location_name": "Museum of Contemporary Art (MOCA Grand Avenue)", "title": "One Day at a Time: Manny Farber and Termite Art", "description": "By\n                \n                    Shana Nys Dambrot                \n\n                                    Most of the time, curators have an idea and organize an exhibition, and then a prominent critic or historian will write an essay contextualizing its ideas. While not quite a full reversal, in the case of \"One Day at a Time: Manny Farber and Termite Art,\" the essay definitely came first. Manny Farber (1917-2008) was a noted critic of art and especially of film, as well as a talented and prolific painter, whose maverick style in both pigment and prose was impassioned and subversive, academically rigorous and flat-out gorgeous. In 1962 he wrote a landmark essay in which he coined the phrase \"termite art\" in making a case for visual and cinematic art that luxuriates in details of ordinary existence rather than chasing the elusive, vainglorious masterpiece. Directly inspired by the ideas Farber laid out, this exhibit was curated by Helen Molesworth and Rebecca Lowery (who leads tonight's walkthrough), and features examples of Farber's work along with some 30 other artists working in painting, sculpture, photography, film, video and sound, dating from the 1950s to the present.", "url": "https://www.laweekly.com/event/one-day-at-a-time-manny-farber-and-termite-art-9978286", "orgName": null, "ticket_info": [{"lowestPrice": "0"}, {"highestPrice": "0"}], "id": "LAweekly_252513ff84ae8fa2de6f7fcd8ba31bba"}
