{"date_startDate": "2018-11-26", "date_endDate": "2019-03-04", "time_startTime": "None", "time_endTime": "None", "location_address": "1739 N. Vermont Ave.", "location_city": "Los Angeles", "location_name": "1739 Public House", "title": "Fringe", "description": "By\n                \n                    Jennifer Swann                \n\n                                    After five years of hosting stand-up show \"Keep It Clean\" at Public House, comedian JC Coccoli decided it was time to revamp the Monday late-night concept by booking comedians not just from L.A. but also from around the country and overseas. \"Being around L.A. for so long, I see the same lineups. But now I'm booking people who are blowing up in Canada or blowing up in Australia, and it opens up the range,\" says Coccoli, whose new show, Fringe, has been dubbed \"comedy with bangs.\" As with every Fringe show, comedians are encouraged to use wigs and props, while Public House foots the bill for the audience's pizza and beer. A sports bar might be an unlikely place for fringe comedy, but it's all part of the concept, Coccoli says. \"I want it to feel like if Andy Warhol had a weird comedy club in his Factory inside a very bro'd-out bar.\" Public House, 1739 N. Vermont Ave., Los Feliz; Mondays, 10 p.m.; free, with passed donation bucket. (323) 663-1739, facebook.com/FringeMondayNights.", "url": "https://www.laweekly.com/event/fringe-4320269", "orgName": null, "ticket_info": [], "id": "LAweekly_490b70b732f10af58a7b6a1bf2af98ef"}
{"date_startDate": "2018-11-26", "date_endDate": "2019-03-04", "time_startTime": "None", "time_endTime": "None", "location_address": "4519 Santa Monica Blvd.", "location_city": "Los Angeles", "location_name": "The Virgil", "title": "Hot Tub with Kurt and Kristen", "description": "By\n                \n                    Julie Seabaugh                \n\n                                    Formerly housed at Littlefield in Gowanus, Brooklyn, the stand-up show Hot Tub has moved across the country and into new digs. Kurt Braunohler (IFC's Bunk, Chelsea Lately), who co-hosts with Kristen Schaal (Flight of the Conchords, The Daily Show) says of the Virgil, \"It's a relatively new space, there were no other comedy shows there when we decided to do our show (although I think since we announced, a bunch have popped up), it's on a slightly creepy corner, and once you get inside you're pleasantly surprised at how nice it is. We always want Hot Tub to feel like you discovered something special, and that it's just for you. The Virgil feels perfect, big enough that there's a real energy to the room, but cozy enough that bigger acts can feel like they can come here and try out new stuff.\" For more see the rest of our article on the show: Hot Tub at the Virgil. 7 p.m. doors, 8 p.m. show. Double-check date and time info at the show's website before going.", "url": "https://www.laweekly.com/event/hot-tub-with-kurt-and-kristen-5410937", "orgName": null, "ticket_info": [{"lowestPrice": "5"}, {"highestPrice": "5"}], "id": "LAweekly_8d391cd97b5d66965d285e830dc8ae15"}
