{"date_startDate": "2018-11-20", "date_endDate": "2019-03-31", "time_startTime": "None", "time_endTime": "None", "location_address": "601 S. Anderson St.", "location_city": "Los Angeles", "location_name": "Venus Over Los Angeles", "title": "Katherine Bernhardt: Fruit Salad", "description": "By\n                \n                    Catherine Wagley                \n\n                                    The exterior of Venus Over Los Angeles, the new West Coast satellite of Venus Over Manhattan gallery, was painted all Pepto-Bismol pink before last week. Now the side of the building is a sunny mural by New York artist Katherine Bernhardt called Fruit Salad \u2014 toucans, fat bananas and flattened cigarettes float across the wall. There\u2019s also an out-of-place interlude in which hammerhead sharks swim around inside a blue rectangle. Especially given the formal-looking grayness of the gallery\u2019s New York headquarters, the mural feels like a comic embodiment of an East Coast stereotype: L.A. as la-la land.", "url": "https://www.laweekly.com/event/katherine-bernhardt-fruit-salad-5874601", "orgName": null, "ticket_info": [], "id": "LAweekly_45811d690802414a73d1aad2b951d45f"}
{"date_startDate": "2018-11-20", "date_endDate": "2019-03-31", "time_startTime": "None", "time_endTime": "None", "location_address": "5905 Wilshire Blvd.", "location_city": "Los Angeles", "location_name": "LACMA", "title": "Hassan Hajjaj: My Rock Stars Experimental, Volume I", "description": "By\n                \n                    Catherine Wagley                \n\n                                    Linda Komaroff, head of LACMA's Art of the Middle East department, recently acquired Moroccan artist Hassan Hajjaj's My Rock Stars Experimental, Volume I for the museum. It includes footage of nine musicians known by the artist, some more famous than others, playing against patterned fabric and wearing fantastic, comfortable-looking costumes Hajjaj made for them. Hajjaj filmed each separately but you see all of them at once, each inhabiting his or her own colorful rectangle and taking turns making music. The multichannel video currently plays in a narrow corridor on the third floor of LACMA's Ahmanson building, by the elevators. It's awkward to see it in that space but interesting, too, because it seems indicative of the still-marginal place contemporary Middle Eastern art holds in most U.S. museum collections. 5905 Wilshire Blvd., Mid-Wilshire; ongoing. (323) 857-6010, lacma.org.", "url": "https://www.laweekly.com/event/hassan-hajjaj-my-rock-stars-experimental-volume-i-4450138", "orgName": null, "ticket_info": [], "id": "LAweekly_144116379c98727b9f292f1d15d0ed01"}
