{"date_startDate": "2018-11-20", "date_endDate": "2019-03-31", "time_startTime": "10:00:00", "time_endTime": "14:00:00", "location_address": "100 S. The Grove Dr.", "location_city": "Los Angeles", "location_name": "Los Angeles Museum of the Holocaust", "title": "Tree of Testimony: L.A. Museum of the Holocaust", "description": "By\n                \n                    Amanda Lewis                \n\n                                    Inspired in part by Nam June Paik's video art, the Tree of Testimony consists of 70 television screens of various shapes and sizes piping interviews with Holocaust survivors into the headphones of museumgoers. Thick black tubes squiggle on the wall behind the TVs, and keywords like \"ghetto cultural activities,\" \"sisters\" and \"wartime photographs\" pop up on the screens to help you decide whose private miseries to experience, meaning which testimony's code to enter into your free iPod Touch audio guide.\n\nConceived by museum board president Randy Schoenberg and executed by architect Hagey Belzberg, the Tree of Testimony represents the first attempt to display the 52,000 Shoah Foundation testimonies outside of stand-alone screens. Over the course of a year, the exhibit will shuffle through the entire collection.See our full story about the Tree of Testimony.Check website for hours. Museum is closed Jan. 1, first day of Passover, Rosh Hashanah, Yom Kippur, Thanksgiving and Christmas.", "url": "https://www.laweekly.com/event/tree-of-testimony-la-museum-of-the-holocaust-5492252", "orgName": null, "ticket_info": [{"lowestPrice": "0"}, {"highestPrice": "0"}], "id": "LAweekly_50af109d814ceaa357d22ca0fed9fcfe"}
