{"date_startDate": "2018-11-20", "date_endDate": "2019-03-31", "time_startTime": "None", "time_endTime": "None", "location_address": "250 S. Grand Ave.", "location_city": "Los Angeles", "location_name": "Museum of Contemporary Art (MOCA Grand Avenue)", "title": "Jonas Wood: Still Life With Two Owls", "description": "Longtime L.A. artist Jonas Wood painted Still Life With Two Owls in 2014. In his characteristically flat, sunny way, he depicts shelves full of plants and pots. Some of the pots are the plain old terracotta kind you\u2019d find at Home Depot. Other colorful, patterned ones look handmade. Sky-blue light shines through the shelves on the right, while those on the left could be in some dimly lit closet. Two pots on the darker side are shaped and painted to look like blinged-out, red-cheeked owls. In time for the holidays, Wood scaled up this painting and applied a slightly altered, vinyl version of it to the street-facing side of MOCA\u2019s Grand Avenue building. So now the outside of the museum depicts a decorative indoor garden.", "url": "https://www.laweekly.com/event/jonas-wood-still-life-with-two-owls-7778491", "orgName": null, "ticket_info": [], "id": "LAweekly_060cbcfb13eaee39c0c397c6b52beb69"}
