{"date_startDate": "2018-11-20", "date_endDate": "2019-03-31", "time_startTime": "11:00:00", "time_endTime": "20:00:00", "location_address": "5905 Wilshire Blvd.", "location_city": "Los Angeles", "location_name": "LACMA", "title": "Loris Greaud: Sculpt", "description": "Only one person at a time can see French artist Loris Greaud\u2019s film Sculpt in LACMA\u2019s Bing Theater, which usually seats up to 600. You go in, guided by an attendant, to an empty chair in the middle of the theater. The chairs around it have been moved away. The film, which runs just under 50 minutes, is black, white and red, the red matching the exit signs that line the otherwise dark theater. It pays romantic, heavy homage to lots of different things \u2014 Voodoo, punk, existential crises, cultural rituals and Care Bears \u2014 though mostly it\u2019s about itself. A priestess does a ritual, cursing rolls of film that will later be used to shoot footage we\u2019re watching. Actress Charlotte Rampling appears at one point wearing a Grumpy Bear suit, though the suit hangs loosely and she appears onstage monologuing over-seriously about the nature of reality, so you might not make the cartoon connection right away.", "url": "https://www.laweekly.com/event/loris-greaud-sculpt-7292258", "orgName": null, "ticket_info": [], "id": "LAweekly_ff569672bc4348dee2a0e2f7929a426b"}
