{"date_startDate": "2018-11-20", "date_endDate": "2019-03-30", "time_startTime": "17:00:00", "time_endTime": "19:00:00", "location_address": "2525 Michigan Ave., B5b", "location_city": "Santa Monica", "location_name": "Lora Schlesinger Gallery", "title": "After Images, New Paintings by Laura Lasworth", "description": "Lora Schlesinger Gallery presents After Images featuring a new series of paintings by Laura Lasworth. Lasworth\u2019s paintings are a manifestation of masterful control of color, shape and form. Each work rich in surface and content, is coded with symbolism that poignantly addresses themes of life, death and spirituality. The show opens with the artist\u2019s reception on Saturday, July 30th from 5:00 \u2013 7:00 pm.\n\nLasworth is known for her sophisticated use of religious, philosophical and personal symbolism. Her work recalls classical allegory and medieval iconography. She extracts subjects from text, bridging the familiar with the sacred, creating images that are mysterious and otherworldly. Since 2001, her method has resembled that of a long-form writer. In her elaborate cycles of paintings, each panel functions as a chapter. Through the paintings a narrative slowly emerges, coaxing a careful reading.  Lasworth\u2019s images echo scripture and sacred history, yet they refrain from didacticism and literalism. Instead her paintings exhibit a respectful melancholy, as if they must span unbridgeable distances. The result is not a sense of futility, but of hope and impending miracle. \nThe event is free and open to the public.", "url": "https://www.laweekly.com/event/after-images-new-paintings-by-laura-lasworth-7089715", "orgName": null, "ticket_info": [{"lowestPrice": "0"}, {"highestPrice": "0"}], "id": "LAweekly_82eb420dedd974dfd93e189bdccd02d7"}
