{"date_startDate": "2018-11-20", "date_endDate": "2019-03-05", "time_startTime": "19:00:00", "time_endTime": "20:00:00", "location_address": "6470 Santa Monica Blvd.", "location_city": "Hollywood", "location_name": "The Pack Theater", "title": "The Deconstruction", "description": "The Deconstruction is The Pack Theater\u2019s signature improv form. Created in Chicago by The Family & Del Close, then developed here in Los Angeles by Miles Stroth. \n\nEveryday relationships are explored and broken apart into a kaleidoscope of the absurd. This diverse cast is hand-picked by the Pack Theater SHaDoW CouNCiL and coached by Josh Mattingly of HMS Death and Haymaker\n\nCast Includes:\nAlex Foster, Jed Alcantara, Corinne Chooey, Lisa Ferris, Jason Frankovitz, Angela Kim, Arie Levine, Leon Nixon, Charles Park & Erik Wargo", "url": "https://www.laweekly.com/event/the-deconstruction-7540232", "orgName": null, "ticket_info": [], "id": "LAweekly_224f85fa08ceaddb986379334828a715"}
