{"date_startDate": "2018-11-20", "date_endDate": "2019-03-30", "time_startTime": "None", "time_endTime": "None", "location_address": "2525 Michigan Avenue, D4", "location_city": "Santa Monica", "location_name": "Revolver Gallery", "title": "Revolver Gallery Presents \"Andy Warhol:Revisited\"", "description": "Revolver Gallery, originally founded by serial entrepreneur Ron Rivlin in 2012, is pleased to announced the opening of its new Bergamot Station location with the critically acclaimed museum-style touring exhibition, \u201cAndy Warhol: Revisited.\u201d Home to the largest gallery-owned collection of Andy Warhol artworks, this prized show will launch on the 30th Anniversary of Andy Warhol\u2019s death, paying tribute to the legendary figure that has influenced and inspired so many art lovers globally.\n\n\u201cAndy Warhol: Revisited\u201d will be a free-with-reservation exhibition debuting with a VIP opening on Saturday February 11th, 2017 from 6:00pm \u2013 10:00pm.\n\nCurated by Revolver Gallery Owner, Ron Rivlin and Gallery Director, Korbin Coskey, \u201cAndy Warhol:Revisited\u201d is a wall-to-wall, salon-style exhibition featuring over 200 artworks by Warhol spanning from the 60s through 80s, including many of Andy\u2019s iconic works.\n\nSome standout items on display include the gallery\u2019s latest acquisition: Andy's 1974 Rolls Royce Silver Shadow along with the original registration which will be the first time Andy\u2019s car will be on display to the public; 15 very rare complete portfolios including Warhol\u2019s Marilyn Monroe suite; a rare 1964 Stable Gallery plywood Campbell\u2019s Juice Box previously owned by famed designer Halston; an extremely rare Andy Mouse portfolio by artist Keith Haring in collaboration with Warhol; and several 1981 paintings including Dollar Sign, black and white Ads and Illustrations series paintings, and Guns - which depicts the weapon used by Valerie Solanas who attempted to murder Warhol in the late 1960\u2019s.", "url": "https://www.laweekly.com/event/revolver-gallery-presents-andy-warhol-revisited-7868325", "orgName": null, "ticket_info": [], "id": "LAweekly_4742ed49b19e3f09640d16b73c36d91f"}
