{"date_startDate": "2018-11-20", "date_endDate": "2019-03-31", "time_startTime": "11:30:00", "time_endTime": "21:30:00", "location_address": "120 E. 8th St", "location_city": "Los Angeles", "location_name": "Escape Room LA", "title": "Escape Room LA Premieres The Alchemist", "description": "Magic and adventure await those who choose to enter Escape Room LA\u2019s newest escape room, The Alchemist. Participants will become adventurers traveling back to a time of medieval sorcery where potions, spells and hexes must be assembled in order for participants to escape.\n\nPart real-life adventure and part clue-solving mystery, participants in Escape Room LA\u2019s acclaimed games will uncover and solve custom clues and puzzles that are gradually revealed as the intriguing rooms\u2019 secrets are discovered. Up to 12 people at a time have one hour to solve the game and escape from the room.\n\nAdventurers make their way into a medieval Alchemist\u2019s library, upon entering the chamber participants are detected and trapped inside. Their only way to escape is to discover a way into the secret lab and combine the four elements to complete the mythical philosopher\u2019s stone before The Alchemist returns to vaporize them. The Alchemist begins December 13th, 2015.", "url": "https://www.laweekly.com/event/escape-room-la-premieres-the-alchemist-6307649", "orgName": null, "ticket_info": [{"lowestPrice": "30"}, {"highestPrice": "35"}], "id": "LAweekly_7b1b7fde750a1b93e65cca81a689dee9"}
{"date_startDate": "2018-11-20", "date_endDate": "2019-03-05", "time_startTime": "None", "time_endTime": "None", "location_address": "140 S. Barrington Pl.", "location_city": "Los Angeles", "location_name": "Il Piccolo Verde", "title": "David Marcus", "description": null, "url": "https://www.laweekly.com/event/david-marcus-6685716", "orgName": null, "ticket_info": [{"lowestPrice": "0"}, {"highestPrice": "0"}], "id": "LAweekly_bf3cf597c584e20246d37b4507589ee3"}
{"date_startDate": "2018-11-25", "date_endDate": "2019-03-03", "time_startTime": "None", "time_endTime": "None", "location_address": "2511 WILSHIRE BLVD", "location_city": "Los Angeles", "location_name": "Dynasty Typewriter At The Hayworth Theatre", "title": "Tomorrow! With Ron Lynch", "description": "By\n                \n                    Sophia Kercher                \n\n                                    The audience members are half-stoned, half-drunk or high on the fact that they're breaking curfew. They are old and young, but mostly bearded and beer-bellied. And they keep coming back, some from as far away as San Diego, for the nutty midnight variety show. You will find such things as wacky video installations, a juggler tossing cigar boxes, Michael Jackson\u2013inspired dance routines, ukulele concerts, one-man-band sets and whiskey-soaked stand-up comedy. Host Ron Lynch, who has been in the comedy scene for 30-plus years, leads The Tomorrow Show with his sardonic observations. As night crawls to morning, Lynch's head of hair grows bigger and bigger. Somewhere within his crop of curls he keeps years of memories including shows that have lasted until 4 a.m., epic nights featuring co-hosts Craig Anton, John C. Reilly or The Kids in the Hall's Scott Thompson. The Tomorrow Show is guaranteed to be one of your weirdest encounters with the L.A. entertainment scene. It's raw and experimental. But the inventive weekly acts are a welcome reminder that you can always start anew tomorrow \u2014 and that's worth a late night in Hollywood.", "url": "https://www.laweekly.com/event/tomorrow-with-ron-lynch-4290611", "orgName": null, "ticket_info": [], "id": "LAweekly_ca65a5e31f2e3ccf4efee38aadd42830"}
{"date_startDate": "2018-11-20", "date_endDate": "2019-03-30", "time_startTime": "11:00:00", "time_endTime": "18:00:00", "location_address": "814 N. La Cienega Blvd.", "location_city": "Los Angeles", "location_name": "KM Fine Arts", "title": "Perception", "description": "Carole A. Feuerman\nPerception\nJuly 15 \u2013 August 20, 2016\nOpening Reception: Thursday July 14, 7 \u2013 9pm\n\nKM Fine Arts is pleased to announce a solo exhibition called \u201cPerception\u201d the first Los Angeles solo exhibition of New York based hyperrealist sculptor Carole A. Feuerman which will be on view from July 14 \u2013 August 20, 2016. Miniature, life-sized, and monumental works will be featured alongside a selection of daimon-dust coated silkscreens. Feuerman's iconic hyper-realistic swimmers and divers will be included in the exhibition and paired with new bronze works from her ballet dancer series.\u00a0\n\nCarole A. Feuerman is recognized as one of the world\u2019s most renowned, influential, and popular hyperrealist sculptors in the 1970\u2019s with her photorealist paintings.\u00a0 Her prolific career spans four decades in which she has pioneered new approaches to sculpture.\u00a0Working in both monumental and life size, and museum size, she is the only figurative artist to\u00a0hyper-realistically\u00a0paint bronze for outdoor public art, painting bronze to look like flesh, and the only sculptor to install these painted bronze sculptures in water.\n\nCarole Feuerman\u2019s\u00a0DurgaMa, inspired by the Hindu goddess Durga. The bronze figure sits in complete tranquility on a sacred lotus flower. She is the symbol of birth, rebirth and survival, which is a common theme present in much of Feuerman's work. The lotus flower can live for over a thousand years and along with Durga's universal powers, she can withstand all that the world throws her way.\n\nFeuerman's works explore classicism while presenting common themes that occur in our everyday lives. The\u00a0sculptures tell powerful stories of experiences the artist has encountered in her own life that she feels compelled to tell. One can relate to them as we all struggle to overcome similar personal obstacles. Evoking inward emotions, Feuerman invites the spectator to identify with the narrative they see before them. Water and swimming have fascinated her all of her life as she has always been captivated by how the water droplets form patterns over the skin.\n\nFeuerman\u2019s work continues her focus on public outdoor sculptures and table-top pieces. Feuerman maintains two studios in Chelsea NY and the other at Mana Contemporary in NJ. On an ongoing basis, Feuerman's work can be seen in selected galleries and museums worldwide.\n\nKM Fine Arts Los Angeles\n814 North La Cienega\nLos Angeles, CA. 90069\nPhone: 310-854-0540\n\nLA Gallery Hours:\nTuesday - Saturday 11am - 6 pm\n\nFacebook:  https://www.facebook.com/kmfinearts/ \n@KMFineArts\n\nFor More Information, Contact:\nJennifer Gross\nEvolutionary Media Group\n323-658-8700\nJennifer@emgpr.com", "url": "https://www.laweekly.com/event/perception-7103466", "orgName": null, "ticket_info": [{"lowestPrice": "0"}, {"highestPrice": "0"}], "id": "LAweekly_64e89bddecd85f2e7b675cd3d137e0f3"}
{"date_startDate": "2018-11-25", "date_endDate": "2019-03-03", "time_startTime": "10:00:00", "time_endTime": "18:00:00", "location_address": "777 S. Alameda St.", "location_city": "Los Angeles", "location_name": "The Row DTLA", "title": "Smorgasburg L.A.", "description": "By\n                \n                    Gwynedd Stuart                \n\n                                    Despite our friendly rivalry with the Big Apple, far be it from Angelenos to turn our noses up at something cool just because it originated on the East Coast. The huge weekly market Smorgasburg, a spinoff of Brooklyn Flea, has been wowing New Yorkers since 2011 (Mario Batali called it \"the single greatest thing I've ever seen gastronomically in New York City\"). Located on the site of the Alameda Produce Market, Smorgasburg brings together a massive number of food vendors \u2014 from Raindrop Cake to Donut Friend to Ramen Burger \u2014 plus furniture, clothing and housewares vendors too. Smorgasburg kicked off on June 19 and continues every Sunday.", "url": "https://www.laweekly.com/event/smorgasburg-la-7040652", "orgName": null, "ticket_info": [], "id": "LAweekly_4e45f8444092ac7d8a78ebd28c44a9e8"}
