{"date_startDate": "2018-11-21", "date_endDate": "2019-03-31", "time_startTime": "None", "time_endTime": "None", "location_address": "Sunset & Westwood blvds.", "location_city": "Westwood", "location_name": "Fowler Museum at UCLA", "title": "Intersections: World Arts, Local Lives", "description": "From the website: \"one of our nation's most important collections of art from Africa, Asia, the Pacific, and the Americas...features approximately 250 of the finest objects from the Fowler's collections in a long-term exhibition that celebrates the richness of world arts and considers the roles these works of art play in peoples' lives.\"", "url": "https://www.laweekly.com/event/intersections-world-arts-local-lives-4291083", "orgName": null, "ticket_info": [], "id": "LAweekly_2c3a555bb2def87ef71c07fe0ebdf559"}
{"date_startDate": "2018-11-23", "date_endDate": "2019-03-31", "time_startTime": "00:00:00", "time_endTime": "17:00:00", "location_address": "9331 Venice Blvd.", "location_city": "Culver City", "location_name": "Center for Land Use Interpretation", "title": "Los Alamos Rolodex: Doing Business With the National Lab 1967-1978", "description": "By\n                \n                    Catherine Wagley                \n\n                                    Edward Grothus used to work as a technician at the Los Alamos National Lab, which worked on the atomic bomb. But he quit his job there at the end of the 1960s, and soon after opened an odd store known as The Black Hole. The store\u2019s inventory would all be cast-offs from the Lab--technical equipment, paperwork or office furniture. Some of it would be quite value, other items obscure. After Grothus died in 2009, the Center for Land Use Interpretation (CLUI) visited the still-open store and found two rolodexes, full of business cards members of the corporate community had handed to the bomb-making lab. Right now, at CLUI\u2019s small Culver City space, cards line the walls. Marketing coordinators, engineers and sales reps from the Kodak Company half-smile in headshots. There\u2019s a sense of outdated aspiration throughout the exhibition -- all these cards belonging to people who hoped to get in on the big business of nuclear war. \u201cUltimately, the bomb was made by people calling other people on the phone,\u201d writes CLUI director Matthew Coolidge in his essay on the rolodexes.", "url": "https://www.laweekly.com/event/los-alamos-rolodex-doing-business-with-the-national-lab-1967-1978-6468286", "orgName": null, "ticket_info": [], "id": "LAweekly_b193f4c6cc92ed8735c6ff7b5433520b"}
