{"date_startDate": "2018-11-25", "date_endDate": "2019-03-03", "time_startTime": "None", "time_endTime": "None", "location_address": "1089 N. Oxford Ave.", "location_city": "Los Angeles", "location_name": "Rogue Machine Theatre", "title": "The Super Variety Match Bonus Round!", "description": "Rogue Machine (\u201cBest Production\u201d - three seasons - Ovation, and Los Angeles Drama Critics Circle Awards) presents the World Premiere of THE SUPER VARIETY MATCH BONUS ROUND! by Deb Hiett. \u201cA sure-shot writer \u2026 bold new voice,\u201d wrote the Village Voice about Deb Hiett\u2019s play Words in a Certain Order, at NYC\u2019s Dixon Place.\nMulti-award winner Cameron Watson directs.\n\nA very modern kid, with no vowels in his/her name, rents a bedroom in the home of a small-town older Texas couple, while attending a big desert music festival weekend. The couple is struggling with grief and how to find a safe place in the big scary rapidly changing world. The kid decides to help. Like a fairy tale come true the couple suddenly find themselves in a 1970s-era TV game show where the stakes are life itself and the prize is a new beginning, during this thrill ride of a comedy. \n\n\"I was surprised at every turn of the page. I\u2019ve always been deeply interested in what tragedy does to the flow of life and how those of us left in the wake of debilitating events deal, or don't deal, with what is left. Because what is left is life as we now know it --- after the explosion, the earthquake, or a fall into the abyss. I think Deb\u2019s play tackles this main conceit from many angles and, in doing so, tackles how we see each other, what we mean to each other, and how we move on. She has draped it with side-splitting humor and fearless imagination. That is no easy feat.\" \u2013 Cameron Watson, Director\n\nThe Super Variety Match Bonus Round! opens at 8:30pm on November 12th and runs at 8:30pm Saturdays and Mondays, 3pm on Sundays through December 19, 2016. ROGUE MACHINE is located at The Met, 1089 N Oxford Ave, Los Angeles, CA 90029. Tickets are $34.99. Reservations: 855-585-5185 or at www.roguemachinetheatre.com    \n\nTwitter: @RogueMachineLA, Instagram: @RogueMachineTheatre\n\nFB: https://www.facebook.com/RogueMachineTheatre", "url": "https://www.laweekly.com/event/the-super-variety-match-bonus-round-7516202", "orgName": null, "ticket_info": [{"lowestPrice": "34"}, {"highestPrice": "34"}], "id": "LAweekly_15bd1d43c0e57bf35df71e0b17ce0a89"}
