{"date_startDate": "2018-11-25", "date_endDate": "2019-03-03", "time_startTime": "None", "time_endTime": "None", "location_address": "89 S. Fair Oaks Ave.", "location_city": "Pasadena", "location_name": "Lineage Performing Arts Center", "title": "The Last Five Years", "description": "Cathy and Jamie's love story has a beginning, a middle, and an end. But in this ingenious telling of their time together, the lovers start at opposite ends of the relationship, meeting only in the middle. What follows is an honest look at two people whose complicated romance wasn't meant to last forever. And, for the first time ever, the thrilling score will feature the added dimension of dance. \n\nLineage Artistic Director Hillary Thomas and Marisa Echeverria have added dance and movement to this modern off-Broadway classic of musical theater, resulting in a fresh, enrapturing performance. \n\nThe show runs Saturdays at 8pm and Sundays at 7pm, June 3rd through 18th and stars Marisa Echeverria, Chris Jones, Michelle Kolb, and Paul Siemens.", "url": "https://www.laweekly.com/event/the-last-five-years-8255044", "orgName": null, "ticket_info": [{"lowestPrice": "25"}, {"highestPrice": "25"}], "id": "LAweekly_2b9faf87f582c8334e5038299b4b4884"}
