{"date_startDate": "2018-11-22", "date_endDate": "2019-03-31", "time_startTime": "None", "time_endTime": "None", "location_address": "1714 N. Vermont Ave.", "location_city": "Los Angeles", "location_name": "Rockwell Table & Stage", "title": "The Last Breakfast Club", "description": "Los Feliz, CA \u2013 It\u2019s the end of the world as we know it - and the brain, the athlete, the basket case, the princess, and the criminal are still stuck in that damn library! The Fuse Project and Rockwell Table & Stage are proud to present the brand new musical parody of THE LAST BREAKFAST CLUB running Thursday, Friday and Saturday nights at Rockwell all summer, through the end of August.\n \nIt\u2019s musical theatre in a world which the most beloved cinema characters from the 1980's era barricade themselves inside the library because the world as we know it has ended. But don't fret, their teenage angst and in-depth exploration of youth continues inside Shermer High School. Grab your tickets before our world really ends, on sale at: www.rockwell-la.com\n\nPost nuclear war - one foot outside turns your brain to zombie mush. What's a teenager to do? Bunker down inside that damn cement library and wait for the world to reset. With a hilarious and insightful book written by Bradley Bredeweg and Kate Pazakis, inspired by the original and beloved classic film, you will both laugh and cry as you cheer for your favorite 80's icons to make it out alive.\n \nThe Fuse Project is excited to announce the official cast for the new show. Garrett Clayton, star of NBC's HAIRSPRAY, Disney's TEEN BEACH MOVIE, and Freeform's THE FOSTERS will play Brian, the Brain. Max Ehrich, two time Emmy Award winner for his star turning performance in CBS's THE YOUNG AND THE RESTLESS, as well as the star of UNDER THE DOME and Hulu's THE PATH will play Andrew the athlete. Jonah Platt who's just coming off his hugely successful Broadway run as Fiyero in WICKED will play Bender the Criminal. Anna Grace Barlow star of Fox's SCREAM QUEENS, Freeform's THE FOSTERS and the recent star of Broadway bound THE PROM will play Claire, the princess. Jimmy Ray Bennet of Netflix\u2019s \u2013 HAND TO GOD will be be playing Vernon and Damon Gravina of FOOTLOOSE will be playing the janitor. Finally, YouTube sensation Lana McKissack will play Allison the basket case.\n \nTickets are on sale now for Thursday, Friday, and Saturday nights with shows beginning on May 18th, 2017. Showtime: 8pm. Rockwell Table & Stage is located in Los Feliz at 1714 N. Vermont Ave, Los Angeles. 323-669-1550 For more information and to purchase tickets, visit www.rockwell-la.com.", "url": "https://www.laweekly.com/event/the-last-breakfast-club-8315466", "orgName": null, "ticket_info": [{"lowestPrice": "20"}, {"highestPrice": "50"}], "id": "LAweekly_3622475ee2210c87b7cf6e59c34dd2dc"}
