{"date_startDate": "2018-11-21", "date_endDate": "2019-03-31", "time_startTime": "00:00:00", "time_endTime": "18:00:00", "location_address": "945 Chung King Rd.", "location_city": "Los Angeles", "location_name": "The Good Luck Gallery", "title": "Charles Steffen", "description": "The Good Luck Gallery is proud to present:\nCharles Steffen\nSeptember 3 - October 29, 2016 \nReception: September 3, 7-10pm\n\nThe combination of visionary and quotidian elements in the work of Charles Steffen attests to both a wildly poetic visual imagination and an uneventful daily life. His drawings - in graphite and colored pencil on large sheets of brown paper - possess a unique and timeless quality; they resemble pages from an idiosyncratic self-referential field guide with sunflowers, crucifixions and figures complemented by scrawled diaristic ruminations. \nThe eldest son in a family of eight children, Steffen studied art at the Illinois Institute of Technology in the late 1940s but his education was cut short by a mental breakdown which resulted in a fifteen year stay at the Elgin State hospital, where he underwent electroshock therapy for schizophrenia. It was there that he began to draw, but his prodigious early output was either lost or discarded. Upon his release, Steffen lived with his family and spent most of his time producing art. After his mother died and the family house was sold, he moved into a retirement home in Chicago, where he died, at the age of sixty-eight, in 1995.", "url": "https://www.laweekly.com/event/charles-steffen-7254820", "orgName": null, "ticket_info": [], "id": "LAweekly_34402d1c04917feb9414dac8502be954"}
{"date_startDate": "2018-11-21", "date_endDate": "2019-03-31", "time_startTime": "None", "time_endTime": "None", "location_address": "1031 Broxton Ave", "location_city": "Los Angeles", "location_name": "Westwood Village", "title": "Escapedom", "description": "Did you ever dream of being an FBI agent? Or think about banding together to fight evil on Earth? Want to visit a parallel universe where everything is strange but also familiar? Or how about valiantly fixing a submarine before it sinks to the ocean floor? It\u2019s time to immerse yourself. Escapedom gives you the opportunity to leave the world you know for one hour and immerse yourself in ours. This real life experience is the latest in escape room entertainment for people of all interests and backgrounds! At Escapedom we offer the perfect alternative to watching a movie. We\u2019ve designed experiences for you which will mirror your memories of first contemplating the The Matrix or unraveling Inception. Make a booking and immerse yourself today and tomorrow as we roll out each of our four unique escape rooms!", "url": "https://www.laweekly.com/event/escapedom-7308777", "orgName": null, "ticket_info": [{"lowestPrice": "26"}, {"highestPrice": "26"}], "id": "LAweekly_48b4b7cccd6f729913b0023e64d419b0"}
