{"date_startDate": "2018-11-23", "date_endDate": "2019-03-30", "time_startTime": "None", "time_endTime": "None", "location_address": "3000 Airport Ave.", "location_city": "Santa Monica", "location_name": "Ruskin Group Theatre", "title": "The Gun", "description": "You\u00a0are who you pretend to be, until the day you wake up when the sun is shining just\u00a0right, and you look in the mirror and wonder\u2026is\u00a0this ALL I wanted? After a failed\u00a0callback for a Broadway show, a struggling actor\u00a0has\u00a0a sudden change of fortune while heading back\u00a0to his childhood friend\u2019s upscale\u00a0apartment. Now infused with his newly found confidence and honesty, he\u00a0unapologetically tries to save those around him. In doing so, he wreaks havoc with his bid for change in order to find happiness. Is\u00a0living a truthful life really possible?\n\nThe Gun opens at 8pm on Saturday, March 18th and runs at 8pm Fridays and Saturdays, and 2pm on Sundays through\u00a0April 30, 2017 (No performances April 14-16, or on April 29th). Ruskin Group Theatre\u00a0is\u00a0located at\u00a03000 Airport Avenue, Santa Monica, CA 90405.\u00a0Tickets are $25 ($20 for\u00a0students, seniors, and guild members) and can be purchased in advance\u00a0by\u00a0calling\u00a0(310) 397-3244 or online\u00a0at\u00a0www.ruskingrouptheatre.com . Ample free parking available on site.", "url": "https://www.laweekly.com/event/the-gun-8035953", "orgName": null, "ticket_info": [{"lowestPrice": "25"}, {"highestPrice": "25"}], "id": "LAweekly_d0c630fdc89f5d7e130c29b306467efe"}
{"date_startDate": "2018-11-25", "date_endDate": "2019-03-03", "time_startTime": "15:00:00", "time_endTime": "17:00:00", "location_address": "487 S Fairfax Ave", "location_city": "Los Angeles", "location_name": "Hyperslow", "title": "Book Reading with Jenny Funkmeyer @ Hyperslow", "description": "This is one of the many stories I want to share with you about the funny, sometimes very surprising paths we each take to find the real, true true peaceful, joyful, loving version of ourselves.\n\nSixteen years ago: \u201cI looked down the deep, dark hole. It had a cool, calm blackness that was very alluring. I want to dive into it, travel to where it ends. My breathing was tight but even. I could do this. I pulled back the trigger. Steady, I aimed at my third eye, I felt the bullet inside the chamber and my third eye pull towards each other like magnets\u2026.\n\nOut of nowhere, I hear, \u201cHow \u2019bout a cup of tea?\u201d Pearly toned, full of peace, singsong. In the voice there is a feeling of normality, like there is nothing wrong. What a good idea! I ease back the trigger; a torrent of sweat suddenly comes from nowhere and pours down my face. My hands are shaking; I gingerly put the gun down\u2026\u201d\n\nThus began an intimate relationship with Sophia, at that time I considered my Spirit Guide. Sophia guided me to negotiate the mine fields of my mental illnesses, my extreme anger and hate. Today, I recognize Sophia is me, I had came back in time to save myself.\n\nAccompanied by live music in a beautiful lovely cafe.\n\nExcerpted from \u201cMAGNUM OPUS\u201d by Jenny Funkmeyer on Funkmeyer Bookies", "url": "https://www.laweekly.com/event/book-reading-with-jenny-funkmeyer-hyperslow-7573312", "orgName": null, "ticket_info": [], "id": "LAweekly_72a93ce5247a55dfb955cdf8162723a1"}
