Kristen Wiig, among others.  You can see these Groundlings alumni in the recent film Ghostbusters as well as television shows such as \u201cPeople of Earth,\u201d \u201cThe Goldbergs,\u201d and \u201cNobodies.\u201d In addition to being comedy performers, Groundlings members and alumni hold writing positions on many of Hollywood\u2019s top television and film projects.", "url": "https://www.laweekly.com/event/the-groundlings-presents-the-seven-deadly-sundays-8311177", "orgName": null, "ticket_info": [{"lowestPrice": "16"}, {"highestPrice": "16"}], "id": "LAweekly_45c84ff9cbf634822378ee0e50b402d0"}
