{"date_startDate": "2018-11-25", "date_endDate": "2019-03-03", "time_startTime": "20:00:00", "time_endTime": "21:00:00", "location_address": "6366 Hollywood Blvd.", "location_city": "Los Angeles", "location_name": "iO West (Improv Olympic)", "title": "Top Story! Weekly", "description": "SNL meets The Daily Show in this constantly changing news-driven sketch romp through a week\u2019s worth of headlines. Every Sunday at 8 Top Story! Weekly brings you a brand new scripted show, which has been called the most ambitious weekly schedule of any LA theater. Our writers have written for shows such as \u201cJimmy Kimmel Live,\u201d \u201cLate Night with Jimmy Fallon,\u201d and \u201cThe Jeselnik Offensive,\u201d and our cast has been seen on shows such as \u201cScandal\u201d, \u201cIt\u2019s Always Sunny in Philadelphia,\u201d \u201cDrunk History,\u201d \"Son of Zorn\", \u201cModern Family,\u201d \u201cThe Middle,\u201d \u201cHow I Met Your Mother,\u201d \u201c2 Broke Girls\u201d and \u201cConan.\u201d With top names from film and television stopping by as guest performers, and a featured comedian every week (past guests have included Bill Burr, Bob Odenkirk, Cameron Esposito and Rob Delaney), \u201cTop Story! Weekly\u201d is the most current, up-to-the-minute sketch show in LA, has been named by CBS 2 in its \u201cBest of Los Angeles\u201d and is a three-time winner of the Del Close Award for \u201cBest Scripted Show\u201d.", "url": "https://www.laweekly.com/event/top-story-weekly-7486987", "orgName": null, "ticket_info": [{"lowestPrice": "5"}, {"highestPrice": "5"}], "id": "LAweekly_de7788f54156f034c274124a6e32608f"}
{"date_startDate": "2018-11-23", "date_endDate": "2019-03-30", "time_startTime": "None", "time_endTime": "None", "location_address": "2035 N. Highland Ave.", "location_city": "Los Angeles", "location_name": "American Legion Hollywood Post 43", "title": "Everything In Between", "description": "Four generations of vets, dealing with their own difficulties, collaborate to help a young man coming home from war in Afghanistan. Lance Porter is haunted by the loss and experiences that followed him back. It is destroying his relationships and life, as he knew it. When his search for solace leads him to another bar, the cynical patrons threaten to lead him further down the rabbit hole.", "url": "https://www.laweekly.com/event/everything-in-between-7594016", "orgName": null, "ticket_info": [{"lowestPrice": "25"}, {"highestPrice": "25"}], "id": "LAweekly_9321a3c2d31be290cea8196f2b7bbc4b"}
{"date_startDate": "2018-11-21", "date_endDate": "2019-03-30", "time_startTime": "00:00:00", "time_endTime": "17:00:00", "location_address": "104 E. Fourth St.", "location_city": "Los Angeles", "location_name": "Los Angeles Center for Digital Art", "title": "John Waiblinger", "description": "By\n                \n                    Shana Nys Dambrot                \n\n                                    Digital art is not always based on photography. Often when the technologies of new media are brought into direct conversation with photos, however, the source materials are borrowed from available popular culture to better add aspects of social critique to the aesthetic program. In the case of John Waiblinger, this dynamic exists along a continuum of pornography, romantic beauty, and the male as both the bringer and object of physical desire. Manipulating images borrowed from commercial homoerotica via considerable digital means, Waiblinger produces colorful, saturated, complex compound images festooned in evocative detail and intimate sensuality, implied nudity and sexual availability, shades of painterly art history, and a certain resignation to obeying the laws of attraction.", "url": "https://www.laweekly.com/event/john-waiblinger-9920488", "orgName": null, "ticket_info": [{"lowestPrice": "0"}, {"highestPrice": "0"}], "id": "LAweekly_93bb442e1215d781546d3632c76d5586"}
