{"date_startDate": "2018-12-05", "date_endDate": "2019-03-10", "time_startTime": "00:00:00", "time_endTime": "19:00:00", "location_address": "3508 W. Washington Blvd.", "location_city": "Los Angeles", "location_name": "The Underground Museum", "title": "Artists of Color", "description": "By\n                \n                    Catherine Wagley                \n\n                                    When he first opened the Underground Museum back in 2012, artist Noah Davis built a replica of a neon sculpture by revered minimalist Dan Flavin and installed it in his new, raw storefront space. He wanted to give his neighborhood access to blue-chip art but didn\u2019t quite have the access himself. The museum has that access now. For the past two years, it has been partnering with MOCA and now, as part of \u201cArtists of Color,\u201d a bona fide Flavin sculpture hangs in the space. Across from the Flavin, artist EJ Hill installed something far less cold and spare: cursive blue neon script that reads \u201cWe deserve to see ourselves elevated.\u201d Artist Jennie C. Jones used twist ties to make bright red cord loop in on itself, and Joe Goode painted a huge canvas completely purple and placed a milk jar painted the same purple on the floor beneath it. There are plenty of artists of color in this show, a rarity in exhibitions about color-field painting, light and space, and other such form-focused movements. The show aims to survey how artists use and play with color in a wider, more diverse way than usual, and it does so elegantly.", "url": "https://www.laweekly.com/event/artists-of-color-8403107", "orgName": null, "ticket_info": [], "id": "LAweekly_5e9f88fe017c318c39d74590b86904bf"}
