{"date_startDate": "2018-11-21", "date_endDate": "2019-03-30", "time_startTime": "14:00:00", "time_endTime": "20:00:00", "location_address": "700 S. Flower St.", "location_city": "Los Angeles", "location_name": "The Bloc LA", "title": "Matt Smiley Dreams Fizzle into Space Art Exhibition", "description": "Matt Smiley\u2019s \"Dreams Fizzle into Space\" art exhibition at The Bloc on May 11th premiered with a smashing success. The exhibition, hosted by The Bloc LA, with partners, Tito\u2019s Vodka, Red Bull, Tsing Tao Beer, with a portion of the proceeds going to Human Rights Watch, sparked a lot of interest in the newly remodeled courtyard in downtown, Los Angeles.\n\nMatt Smiley's Solo Exhibition focused on dreams. Not just his dreams, but those created by everything and everyone around him: People. Books. Poetry. Music. Films, TV, Fine Art, The Internet.\n\nThe show will now be open to the public, starting Thursday, May, 24th at The Bloc in DTLA and run through June 10th. Prepare to enter a world of discovery designed to trigger your imagination and inspire you.", "url": "https://www.laweekly.com/event/matt-smiley-dreams-fizzle-into-space-art-exhibition-8288709", "orgName": null, "ticket_info": [], "id": "LAweekly_44d657aa645067cdd41683ccd8410834"}
{"date_startDate": "2018-11-21", "date_endDate": "2019-03-30", "time_startTime": "11:00:00", "time_endTime": "17:00:00", "location_address": "2525 Michigan Ave., G6", "location_city": "Santa Monica", "location_name": "First Independent Gallery (FIG)", "title": "Curtis Hoekzema: \"Paintings\"", "description": "The first thing most people will notice about the paintings of Curtis Hoekzema is his distinctively unique style.  Using his keen talent for focused observation and witty interpretation, Hoekzema has a natural sense when it comes to capturing the essence of his subject.  In this exhibition Hoekzema explores a wide variety of subjects, often revisiting works begun earlier, and it is fascinating to see how the artist\u2019s mind works.  Angelenos familiar with the Arroyo Seco parkway will immediately recognize how Hoekzema is able to portray the experience of driving along that iconic freeway landscape.  A cat lounging in the shade of a tree is the inspiration for investigating the patterning of light and shadows through the foliage and the hatch marks of the tree bark.  Blossoms and flower petals, still lifes, bulbous rock formations, studio figure models, all pass through the artist\u2019s eye and are stripped down to shape, pattern and color, the essential building blocks of Hoekzema\u2019s paintings.  These are quirky, cheerful and immensely likeable works that will appeal to anyone who appreciates the art of painting.", "url": "https://www.laweekly.com/event/curtis-hoekzema-paintings-6896227", "orgName": null, "ticket_info": [{"lowestPrice": "0"}, {"highestPrice": "0"}], "id": "LAweekly_cbc9a5d6d6ba60809c15c056a470ae5b"}
