{"date_startDate": "2018-11-23", "date_endDate": "2019-03-30", "time_startTime": "None", "time_endTime": "None", "location_address": "7307 Melrose Ave.", "location_city": "Los Angeles", "location_name": "The Groundlings Theater", "title": "Groundlings Hook-Up App", "description": "If you\u2019ve been struggling with dating app after dating app, then The Groundlings has the solution for you with their all-new comedy show, \u201cGroundlings Hook-up App.\u201d Tinder and Bumble don\u2019t have anything on this one-of-a-kind experience only The Groundlings can offer. The always hilarious Groundlings, Los Angeles\u2019 premiere comedy troupe of 43 years, are here to bring you an evening full of love and laughs thanks to their original sketches and improvisation.", "url": "https://www.laweekly.com/event/groundlings-hook-up-app-7481397", "orgName": null, "ticket_info": [{"lowestPrice": "20"}, {"highestPrice": "20"}], "id": "LAweekly_d4cdceb72afd773e0404540e75d72802"}
