{"date_startDate": "2018-11-21", "date_endDate": "2019-03-30", "time_startTime": "11:00:00", "time_endTime": "17:00:00", "location_address": "2525 Michigan Ave., G6", "location_city": "Santa Monica", "location_name": "First Independent Gallery (FIG)", "title": "Hilary Taub \"Recent Work\"", "description": "Hilary Taub approaches the figure from an abstract painter\u2019s perspective.  Her paintings are composed of subtle earth colors, painterly atmospheric passages and gracefully fluid markings. Taub has developed a personal style that effortlessly moves between abstraction and figuration, creating exquisite work that is refined, confident, and strikingly beautiful.  Taub works and re-works images, allowing the final painting to emerge out of a controlled chaos.  As she builds up multiple layers she will eventually arrive at a finished painting of perfect balance and harmony.  Her finished (and often unfinished) figures pleasantly tease the observer\u2019s eye, suggesting perhaps a pose or a gaze, but leaving final interpretation to the viewer.", "url": "https://www.laweekly.com/event/hilary-taub-recent-work-7552619", "orgName": null, "ticket_info": [{"lowestPrice": "0"}, {"highestPrice": "0"}], "id": "LAweekly_ebaf32df0c5db99b08a3d071de81900c"}
{"date_startDate": "2018-12-14", "date_endDate": "2019-03-08", "time_startTime": "22:00:00", "time_endTime": "23:00:00", "location_address": "6470 Santa Monica Blvd.", "location_city": "Hollywood", "location_name": "The Pack Theater", "title": "Your TPT Late Night Show Tonight!", "description": "Your TPT Late Night Show Tonight is late-night with a twist. Every show has a different host, guests, performers, and writing staff!\n\nEach month come see your favorite Comedians build a completely new and original talk show in their own voice. Monologue jokes, special guests, music, lasers, a live elephant!\n\nWe can\u2019t necessarily promise any of those things, because every single episode will be a brand new, one-time-only, must-see show. It\u2019s a new late-night training ground tradition.\n\nProduced by Ben Kuerschner (The Tonight Show) Gil Baron (UCB Digital) and Jonathan Grant (Rotato)", "url": "https://www.laweekly.com/event/your-tpt-late-night-show-tonight-7552634", "orgName": null, "ticket_info": [], "id": "LAweekly_f4fa067bbbb8003733c762cc20c87d7e"}
{"date_startDate": "2018-11-21", "date_endDate": "2019-03-30", "time_startTime": "00:00:00", "time_endTime": "18:00:00", "location_address": "3006 W. Seventh St., #220", "location_city": "Los Angeles", "location_name": "Commonwealth & Council", "title": "Patricia Fernandez's Point of Departure: Five Walks", "description": "By\n                \n                    Catherine Wagley                \n\n                                    Over the past three years, artist Patricia Fernandez, who lives in L.A. but was born in Spain, took five walks through the Pyrenees mountains that separate Spain from France. She was retracing routes her own relatives took at the end of the 1930s, after the Spanish Civil War, when they, like so many other defeated Republicans, trekked off. Along the way, Fernandez collected souvenirs, documents and photographs that she then recreated as paintings, drawings or objects. She also invented artifacts based on her own memory or sensory experiences. Walking through her show at Commonwealth and Council is like opening up a grandmother\u2019s trunk and finding that everything in it, even documents related to the harshest memories, has been tenderly, painstakingly handmade then carefully arranged.", "url": "https://www.laweekly.com/event/patricia-fernandezs-point-of-departure-five-walks-5562978", "orgName": null, "ticket_info": [], "id": "LAweekly_055efabe2ca3d48f99a97665e93423e8"}
{"date_startDate": "2018-11-21", "date_endDate": "2019-03-30", "time_startTime": "11:00:00", "time_endTime": "17:00:00", "location_address": "2525 Michigan Ave., G6", "location_city": "Santa Monica", "location_name": "First Independent Gallery (FIG)", "title": "Arleen G. Hendler \"Works on Paper\"", "description": "\"Painting is my way of coming to grips with the unpredictable nature of our collective existence on our precarious planet.\"   -A.G.H.\n\nArleen G. Hendler presents a versatile group of works on paper in watercolor and pastel. Her intimate approach to the subject matters at hand, land and cityscape, still life and portrait, display dominant concerns with geometric composition, drawing, and expressive paint handling. \n\nHendler received her M.A. from UCLA and lives and works in Los Angeles, CA.  Her paintings are in numerous private collections.", "url": "https://www.laweekly.com/event/arleen-g-hendler-works-on-paper-7729235", "orgName": null, "ticket_info": [{"lowestPrice": "0"}, {"highestPrice": "0"}], "id": "LAweekly_4532c68b2133e404f49a870839abf181"}
{"date_startDate": "2018-11-24", "date_endDate": "2019-03-31", "time_startTime": "None", "time_endTime": "None", "location_address": "12505 Cultural Center Dr.", "location_city": "Rancho Cucamonga", "location_name": "Lewis Family Playhouse", "title": "Rancho Cucamonga Community Theatre presents Pride & Prejudice", "description": "Elizabeth and her four sisters are in dire need of financial security and escape in the shape of husbands. Ms. Elizabeth Bennet is young, clever and pleasing on the eyes. Her mother is foolish and brash. The timely arrival of an agreeable Mr. Bingley and the arrogant Mr. Darcy turn everyone\u2019s lives upside down in this witty drama of friendship, rivalry, enmity and love. Join us as Jane Austen\u2019s universal beloved romantic comedy comes to life on stage. Performance dates run November 5 \u2013 13, 2016 with performance times on Saturdays (November 5 & 12) at 7:30 pm and Sundays (November 6 & 13) at 2:00 pm at the Lewis Family Playhouse, 12505 Cultural Center Drive, Rancho Cucamonga, CA 91739.", "url": "https://www.laweekly.com/event/rancho-cucamonga-community-theatre-presents-pride-and-prejudice-7235981", "orgName": null, "ticket_info": [{"lowestPrice": "20"}, {"highestPrice": "2752"}], "id": "LAweekly_a51525647980b57dcf9f7b0f02a5c0c5"}
