{"date_startDate": "2018-11-23", "date_endDate": "2019-03-30", "time_startTime": "20:00:00", "time_endTime": "23:00:00", "location_address": "6320 Santa Monica Blvd.", "location_city": "Hollywood", "location_name": "The Second Stage at Sacred Fools Theatre", "title": "Macbeth: Revisited", "description": "MACBETH: REVISITED:A TALE OF PROPHESY, MURDEROUS AMBITION AND UNCHECKED POWER\n\nAward-winning company The New American Theatre celebrates their 21st Anniversary season with William Shakespeare\u2019s \u201cMacbeth: Revisited\u201d an intimate re-telling of William Shakespeare\u2019s Macbeth, a \u2018tale of prophesy, murderous ambition, and unchecked power. \n\nDirected by New American Theatre artistic director Jack Stehlin (Odyssey Theatre/NAT\u2019s \u201cTempest Redux,\u201d Showtime\u2019s \u201cWeeds\u201d), who also plays the title role, Macbeth: Revisited features a gender-bending cast of New American Theatre company members. \n\nABOUT THE PLAY:\nPrompted by supernatural predictions, Scottish warrior Macbeth colludes with his wife to murder his way onto the throne. What happens next is a cautionary tale of prophesy, unchecked power and free will. Derived from Shakespeare's Macbeth, this intimate re-telling is a bare-boned ritual of theater with media.\n\nMacbeth: Revisited is presented by the same team that brought last years smash hit TEMPEST REDUX.", "url": "https://www.laweekly.com/event/macbeth-revisited-8044352", "orgName": null, "ticket_info": [{"lowestPrice": "15"}, {"highestPrice": "35"}], "id": "LAweekly_6e91eeb0c1131d640f188a0aa66a2108"}
