{"date_startDate": null, "date_endDate": null, "time_startTime": "00:00:00", "time_endTime": "17:00:00", "location_address": "465 N. Beverly Dr.", "location_city": "Beverly Hills", "location_name": "The Paley Center for Media", "title": "You Can\u2019t Stop the Beat: the Art & Artistry of Hairspray Live!", "description": "The Paley Center for Media welcomes you to the '60s with this dazzling new exhibit. You Can\u2019t Stop the Beat: the Art & Artistry of Hairspray Live! will take visitors into the world of the critically acclaimed hit NBC and Universal Television musical event Hairspray Live! based on the Tony Award\u2013winning Broadway blockbuster.\n\nVisitors to the exhibit will also be able to see eye-popping costumes, actual set pieces and props from Tony and Emmy\u2013Award winning Hairspray Live! production designer Derek McLane, plus dynamic on-set photography, behind-the-scenes video segments, and big-screen presentations of the musical hit.", "url": "https://www.laweekly.com/event/you-cant-stop-the-beat-the-art-and-artistry-of-hairspray-live-8168031", "orgName": null, "ticket_info": [], "id": "LAweekly_1b9787d7c42dd9784f30fb93f74ac336"}
