{"date_startDate": "2018-11-21", "date_endDate": "2019-03-06", "time_startTime": "None", "time_endTime": "None", "location_address": "10715 Missouri Ave Apt 305", "location_city": "Los Angeles", "location_name": "Timothy Maher", "title": "Bar Line Tours", "description": "There\u2019s A New Bar Crawl In Town, And It\u2019s Educational \n\nFOR RELEASE March 8, 2017. CONTACT: Tim Maher, Bar Line Tours Founder. PHONE: 760-717-9209. EMAIL: info@barlinetours.com\n\nLos Angeles, March 8, 2017 || Exploring the artisanal food and beverage scene in Los Angeles has long been one of the city\u2019s premier pastimes. However, getting across town in a cheap and timely fashion has remained a challenge until the recent expansion of the Metro system. Enter Bar Line Tours.\n\nThe Los Angeles based tourism service is currently offering guided beverage and food tasting tours on the Expo and Gold lines, and will expand to feature some of the most eclectic neighborhood bars in the city, all by way of the Los Angeles Metro. \n\n\u201cThe idea was to show patrons the under-the-radar parts of the city, and the energy they contribute to the whole of Los Angeles. While expanding their palates at the same time,\u201d said founder and lead tour guide Tim Maher. \u201cYou can really get a feel for the vibe of the neighborhood by seeing what their bars specialize in.\u201d\n\nTours can be reserved at barlinetours.com and will take place on the Expo, Gold, Purple, and Red lines, with stops at several bars and restaurants within walking distance of the respective metro lines. However, the name of the game isn\u2019t speed drinking, it\u2019s working out everyone\u2019s tasting muscles. \u201cNow more than ever, people care about what they are eating and drinking,\u201d says Maher, who has an Environmental Science and Anthropology background, and has spent time bartending at the renowned Father\u2019s Office. \u201cAs artisans experiment with new recipes, people get even more adventurous and curious about what they want to eat and drink next.\u201d\n\nEND", "url": "https://www.laweekly.com/event/bar-line-tours-8005973", "orgName": null, "ticket_info": [{"lowestPrice": "89"}, {"highestPrice": "89"}], "id": "LAweekly_9b743408c3daf38ca6c5c9736bfaa670"}
