{"date_startDate": "2018-11-24", "date_endDate": "2019-03-02", "time_startTime": "None", "time_endTime": "None", "location_address": "723 E San Ysidro Blvd", "location_city": "San Ysidro", "location_name": "San Ysidro Transit Center", "title": "Street Food Tour for Foodies", "description": "Join Wild Foodie Tours for an all-inclusive, fun, gritty, and insightful street food tour in Tijuana!  You'll enjoy tastings at 5 food stops, 1 non-alcoholic beverage stop, and 1 dessert stop to taste the best flavors of Tijuana.  Other likely visits include the Mercado Hidalgo open-air market and a Mexican bakery.\n\n\nAlong the way we'll point out a few of the eateries Anthony Bourdain and Andrew Zimmern showcased on their Travel Channel shows.  Only $69!  Everything included: food, transportation, shopping, sightseeing, and a tour guide!\n\nGuests meet at the McDonald's at the San Ysidro Trolley Station.  Reservations required.", "url": "https://www.laweekly.com/event/street-food-tour-for-foodies-10073596", "orgName": null, "ticket_info": [{"lowestPrice": "69"}, {"highestPrice": "69"}], "id": "LAweekly_7912aba384cbb995935a793c3804e50a"}
{"date_startDate": "2018-11-24", "date_endDate": "2019-03-02", "time_startTime": "10:00:00", "time_endTime": "16:00:00", "location_address": "315 W. Torrance Blvd.", "location_city": "Carson", "location_name": "International Printing Museum", "title": "International Printing Museum", "description": "By\n                \n                    Eve Weston                \n\n                                    Letterpress printing is enjoying a revival, and the International Printing Museum is Mecca for this retro art, boasting the Ernest A. Lindner Collection of Antique Printing Machinery, considered by authorities to be one of the largest, most comprehensive collections of historic graphic arts equipment in the world. Linder regularly rented his antique printing equipment to the movie studios, so there's a chance you've seen some of these presses before, playing a role in Newsies, Bonanza, The Twilight Zone, The Last Samurai, Catch Me If You Can or Seven Pounds, to name a few. Visit the museum and you can get their autograph \u2014 really. Museum volunteers run the presses for you, explaining how they work, and, if you're lucky, you might take home a souvenir broadsheet. It's a more personalized experience than most museums around town, and educational too \u2014 you'll leave understanding why we designate letters \"uppercase\" and \"lowercase,\" and whence came the oft-bandied about entertainment industry term \"slugline.\" (Only open to the public on Saturdays from 10 a.m. to 4 p.m., other times are by appointment)", "url": "https://www.laweekly.com/event/international-printing-museum-4290963", "orgName": null, "ticket_info": [{"lowestPrice": "10"}, {"highestPrice": "10"}], "id": "LAweekly_683217baff9c8e80afbd52ca656310b9"}
