{"date_startDate": "2018-11-24", "date_endDate": "2019-03-02", "time_startTime": "10:15:00", "time_endTime": "00:00:00", "location_address": "12746 W Jefferson Blvd #3190", "location_city": "Los Angeles", "location_name": "Cinemark Playa Vista and XD", "title": "Play Minecraft on the Big Screen in Your Local Los Angeles Theater!", "description": "Calling all gamers! On Saturdays starting April 29th and ending on May 20th, you can play Minecraft in Super League Gaming\u2019s City Champs, where your city\u2019s team will match up against 11 other cities across the country. Your creativity, critical thinking and teamwork will be put to the test during each event. Whether you\u2019re a fearless zombie slayer, an unstoppable goalie, or a master builder \u2013 seven unique game modes and heroes of all shapes and sizes give every player the chance to bring glory to their city! Come out to your local Cinemark Playa Vista theater, play your favorite game and make new friends, all while representing the Los Angeles Shockwaves!", "url": "https://www.laweekly.com/event/play-minecraft-on-the-big-screen-in-your-local-los-angeles-theater-8164861", "orgName": null, "ticket_info": [{"lowestPrice": "60"}, {"highestPrice": "60"}], "id": "LAweekly_033d0e678a8609e4b3fcd1e3f60d2d87"}
{"date_startDate": "2018-11-24", "date_endDate": "2019-03-02", "time_startTime": "None", "time_endTime": "None", "location_address": "1652 N. Cherokee Ave.", "location_city": "Los Angeles", "location_name": "Boardner's", "title": "The Snowball Party", "description": "PRESS QUOTES\n\"You\u2019ll have fun. You will. For sure.\" -Thrillist LA, Top 5 Things to DO.\n\n\u201cThe new peripatetic adventure... the group increases until 32 strangers suddenly have a wealth of experiences to bond over\u201d -LA Times\n\n\u201cGreat fun, conversation flowed, a great opportunity to party.\u201d -LAist. \n\n\u201cA surprisingly low-pressure way to make connections, meet someone or get to know the city a little better\u2026ingenious.\u201d -LA Weekly \"\n\n\nThe Snowball Party is a tribal, pop-up adventure, a scavenger hunt where you collect people, a \u201chappening\u201d for the age of connectivity. At its core, the Snowball is an experience that serves to activate our digital soul with an analog spirit. To fully understand Snowball, please view our website and explainer, but here\u2019s how it works.\n\nYou start the party doing an activity with someone you've never met before, then you meet up with another pair, then another foursome, and soon you're into a group of 8 then 16 people reveling the the city and the night.", "url": "https://www.laweekly.com/event/the-snowball-party-8288755", "orgName": null, "ticket_info": [{"lowestPrice": "55"}, {"highestPrice": "55"}], "id": "LAweekly_4fdcca4aac2c84cb62249d864b74a8a5"}
