{"date_startDate": "2018-12-07", "date_endDate": "2019-03-01", "time_startTime": "21:00:00", "time_endTime": "22:15:00", "location_address": "5419 W. Sunset Blvd.", "location_city": "Los Angeles", "location_name": "UCB Sunset", "title": "That NEW NEW Sketch Show", "description": "Enjoy a night of sketch comedy, at the very popular UCB Theater, for \"That NEW NEW Sketch Show!\" Hosted and headlined by UCB veteran team Private Street, you are certain to have a great time and laugh your butt off. And you will also see comedy from two additional teams comprised by some of the funniest people in Los Angeles. (The UCB theater was founded by Amy Poehler, Matt Besser, Matt Walsh, Ian Roberts, and is home to some of the funniest comedians in Los Angeles.) This show is the first Friday of every month!", "url": "https://www.laweekly.com/event/that-new-new-sketch-show-7967561", "orgName": null, "ticket_info": [{"lowestPrice": "12"}, {"highestPrice": "12"}], "id": "LAweekly_33763b5da4f9c77aae1d3553de518c86"}
{"date_startDate": "2018-12-07", "date_endDate": "2019-03-01", "time_startTime": "20:00:00", "time_endTime": "21:00:00", "location_address": "6470 Santa Monica Blvd.", "location_city": "Hollywood", "location_name": "The Pack Theater", "title": "I'm A Pilot", "description": "Every month some of LA's best up-and-coming comedic actors perform a new unseen original television sit-com pilot, written by a local comedian, live on the Pack Theater stage. This is not a boring table read, it's a fully rehearsed and performed TV show on stage, complete with parody commercial breaks. It's just like watching TV, but more work because you have to go somewhere!", "url": "https://www.laweekly.com/event/im-a-pilot-7714682", "orgName": null, "ticket_info": [], "id": "LAweekly_6825f9a75df238a9e3c66de68fa2998d"}
{"date_startDate": "2018-11-23", "date_endDate": "2019-03-01", "time_startTime": "19:00:00", "time_endTime": "21:00:00", "location_address": "2629 Purdue Ave.", "location_city": "Los Angeles", "location_name": "Write Your Life LA", "title": "Life Writing Classes/Healing Pen Ink", "description": "We are starting a weekly life-writing class called Healing Pen, Ink on Tuesday, Jan. 3rd from 7 to 9 p.m. at the west L.A. \"Farmhouse,\" located at 2629 Purdue Ave. The first class will be free, so it's a great opportunity to come check out our community. Please check out our flyer below, which will give you more info about Healing Pen, Ink and our website, www.writeyourlifela.com... ?\n\nCome join our table as we journey the writer's path together and share our stories\u2014both real and fictional. Sit back, relax and sip on something delicious by the fire. Write Your Life LA is all about taking your story to the next level\u2014and having a lot of fun while doing it. ??Healing Pen, Ink provides insightful (and fun) writing exercises, especially for women in transition, to explore emotions, put a positive spin on life events, focus and reflect on purpose, reignite bliss and tap creativity for story work. At any point, you have the power to change your story. Don't let anyone else hold the pen. This dynamic life-writing course, designed especially for women in transition, offers:\n\n\u2022 Time to take all of those thoughts that keep your mind racing and put them down on paper. ?\n\u2022 Tools on how to use writing to let go, re-ignite your bliss and discover your true authentic self. \n?\u2022 Support for women. In the pursuit to get ahead, some feel the need to compete or take each other down. We're out to change that for good and create an undeniable force of sisterhood. We want to unite all women to inspire lasting change and healing through writing.\n ?\u2022 Laughter. It's the best medicine, and we like to laugh. A lot. So know that we're going to have a lot of fun, too. The power of good girlfriends makes everything better. ??\n\nAlong with creating a planned class syllabus each week and writing assignment, we will provide endless cups of organic chai, and a toasty fire out on the terrace or in the Writer's Room. There will be some fun surprises, too, in the form of dancing, cinema therapy, letting go, and wish-crafting! Put your feet up. Let your hair down. Get inspired\u2014and inspire others\u2014by sharing stories, having great conversations and connecting within a supportive sacred space. ??Time to become the authors of our own stories, ladies. Feel free to bring a friend and a comfy blanket to keep you warm out by the fire. We'll have endless cups of chai on tap here. Please bring a small notebook or journal (and your favorite pen) with you.\n\nWe look forward to you joining our Writer's Room! Please RSVP to this email if you plan to attend: info@writeyourlifela.com ??\nBeth and Courtney, The Garage Girls\n?www.writeyourlifela.com ?Or call/text for more info: 503.915.0084", "url": "https://www.laweekly.com/event/life-writing-classes-healing-pen-ink-7758007", "orgName": null, "ticket_info": [], "id": "LAweekly_3a2738f56740fb63a67541857b52e345"}
