{"date_startDate": "2018-11-23", "date_endDate": "2019-03-01", "time_startTime": "None", "time_endTime": "None", "location_address": "1137 S. Cochran Ave.", "location_city": "Los Angeles", "location_name": "The Mackey Apartments", "title": "The Los Bar", "description": "By\n                \n                    Catherine Wagley                \n\n                                    Architect Adolf Loos designed his American Bar in Vienna, a fantastic construction with onyx walls and marble floors, in 1903. It was only 290 square feet and it had, and still has, a stain glass American flag above the entrance. Andreas Bauer, Christoph Meier, Robert Schwarz and Lukas Stopczynski, all current artists-in-residence at the MAK Center for art and architecture, have built a poor man\u2019s version of the Loos Bar in Mid-Wilshire. Theirs is slightly smaller, since it had to fit into a garage (each artist-in-residence has a narrow, one-car garage as a studio). There\u2019s exposed wood and white lights in place of Loos\u2019s original shiny exterior, mosquito mesh in place of glass. It\u2019s usually full on Friday nights \u2014 by 9 or 10 p.m., you can\u2019t move without brushing up against someone else. Aluminum ashtrays made from melted PBR cans sit on the counter.", "url": "https://www.laweekly.com/event/the-los-bar-5847342", "orgName": null, "ticket_info": [], "id": "LAweekly_1e39a565ec755bf9aba7ee766148a371"}
{"date_startDate": "2018-11-23", "date_endDate": "2019-03-01", "time_startTime": "None", "time_endTime": "None", "location_address": "3000 Airport Ave.", "location_city": "Santa Monica", "location_name": "Ruskin Group Theatre", "title": "It's Time", "description": "Originating from the true story Time Flies When You\u2019re Alive, HBO Showcase (Ace Award nominee), IT\u2019S TIME is a World Premiere production bringing humor and warmth to a story about self-discovery and conquering even the toughest challenges. This remarkable journey celebrates the paths we choose in life and the resilience of a young family, once broken, living in Los Angeles. Created by award winning writer/performer Paul Linke, it gives audiences a look at how a once lost young man found his way to success, by taking a chance and grabbing at the opportunities and strength that he saw around him.", "url": "https://www.laweekly.com/event/its-time-7470452", "orgName": null, "ticket_info": [{"lowestPrice": "20"}, {"highestPrice": "25"}], "id": "LAweekly_bf6fbde0b914cc4abb0d5b488299b765"}
