{"date_startDate": "2018-12-13", "date_endDate": "2019-03-14", "time_startTime": "00:00:00", "time_endTime": "22:00:00", "location_address": "634 S. Spring St.", "location_city": "Los Angeles", "location_name": "American Friends Service Committee", "title": "Downtown LA Art Walk", "description": "The free, self-guided, public art phenomenon known as The Downtown Art Walk  brings together art lovers and community friends to the ever evolving downtown Los Angeles. With exciting and unique offerings around every corner, downtown celebrates the arts each and every month on the 2nd Thursday. Please refer to your calendar for specific dates. Hours vary by gallery, but can typically range from Noon \u2013 10PM.\n\n \nMany of The Downtown Art Walk activities take shape in and around the galleries predominantly on Spring and Main streets between 2nd and 9th streets. However, there is a plethora of art related events and openings, activities, and special programming that take place all over downtown. For the true art buyers and fans, arriving early offers a more relaxing stroll through the different galleries and art exhibits. As the evening progresses, more visitors descend on the area to meet up with friends and savor the local experience. Visitors and local downtowners can often be found patronizing the outcropping of local shopping, dining and entertainment establishments that have created the thriving, vibrant community.", "url": "https://www.laweekly.com/event/downtown-la-art-walk-5443660", "orgName": null, "ticket_info": [], "id": "LAweekly_f5fb4ca3648ebab2ad18369e23a28ec5"}
