{"date_startDate": "2018-11-20", "date_endDate": "2019-03-19", "time_startTime": "None", "time_endTime": "None", "location_address": "4519 Santa Monica Blvd.", "location_city": "Los Angeles", "location_name": "The Virgil", "title": "Victory Lap", "description": "By\n                \n                    Jennifer Swann                \n\nVictory Lap is a variety show, emphasis on the variety: There\u2019s a traditional house band and stand-up comedians (Megan Koester, Brendon Small, Dan St. Germain) between sets, but then there are the weirder things: puppet surgery, tap dancing, busking. Even stranger is what takes place offstage: slow dancing, usually. That\u2019s because at Victory Lap, there\u2019s no separation between performers and audience members, and the latter can purchase raffle tickets for a chance to take the stage and spin a giant wheel that will lead to either humiliation or victory \u2014 often, one is the result of the other, and there are plenty of cool prizes as consolation. Tonight\u2019s Halloween-themed shindig is hosted by Dracula (who looks a lot like Victory Lap co-host Seth W. Owen) and the wheel features more frightening challenges than usual. \u201cIf it lands on a s\u00e9ance, we\u2019ll have a s\u00e9ance onstage,\u201d producer Sharon Eisman says. \u201cWe\u2019re a little nuts. This is the most nuts we get.\u201d", "url": "https://www.laweekly.com/event/victory-lap-4566333", "orgName": null, "ticket_info": [], "id": "LAweekly_36857e1056e7199bf9ee8bbbe2b2561f"}
