{"date_startDate": "2018-11-20", "date_endDate": "2019-01-19", "time_startTime": "10:00:00", "time_endTime": "17:00:00", "location_address": "700 Exposition Park Dr.", "location_city": "Los Angeles", "location_name": "California Science Center", "title": "\"King Tut: Treasures of the Golden Pharaoh\"", "description": "By\n                \n                    Siran Babayan                \n\n                                    Travel back to ancient Egypt at California Science Center's latest, highly anticipated exhibit, \"King Tut: Treasures of the Golden Pharaoh.\" As part of a years-long international tour, the collection \u2014 the largest ever displayed outside Egypt \u2014 marks the centennial of the discovery of Tutankhamun's tomb by British archaeologist Howard Carter in 1922, more than 3,000 years after King Tut's death. Organized into nine galleries, the 150 artifacts include gold jewelry, carvings, sculptures and ritual antiquities, in addition to 3-D visuals, digital content and audio. Among the highlights are a life-sized statue of the pharaoh, ceremonial bed, golden shrine with scenes of Tutankhamun and his wife, Ankhesenamun, and a jeweled coffinette that held his mummified liver.", "url": "https://www.laweekly.com/event/king-tut-treasures-of-the-golden-pharaoh-9275546", "orgName": null, "ticket_info": [{"lowestPrice": "19"}, {"highestPrice": "29"}], "id": "LAweekly_35d48e960947531a173a787ae130e765"}
{"date_startDate": "2018-11-20", "date_endDate": "2019-02-28", "time_startTime": "None", "time_endTime": "None", "location_address": "5905 Wilshire Blvd.", "location_city": "Los Angeles", "location_name": "LACMA", "title": "The 1/4 Mile or 2 Furlong Piece", "description": "By\n                \n                    Shana Nys Dambrot                \n\n                                    Can an artist truly make one single work that encapsulates the whole of their practice? Well, in the case of icon Robert Rauschenberg (1925-2008), he spent 17 years trying. Made between 1981 and '98, and measuring end to end a full quarter-mile, Rauschenberg's epic The 1/4 Mile or 2 Furlong Piece comprises nearly 200 component panels, which in turn incorporate the eclectic olio of found materials, objects, photographs, collages, textiles, furniture, paint, cardboard and even traffic lights that characterized his omnivorous taste for appropriated and recycled sources. The mammoth work serves not only as a self-styled survey of his own practice but also as a kind of travel log, in which time spent in Asia, Latin America, Europe, Africa and the United States yielded the mother of all souvenir archives. Notably, LACMA's installation of this astonishing work of patience, obsession and subversive art history will be the first time it has ever been exhibited in its complete form.", "url": "https://www.laweekly.com/event/the-1-4-mile-or-2-furlong-piece-10000924", "orgName": null, "ticket_info": [{"lowestPrice": "20"}, {"highestPrice": "20"}], "id": "LAweekly_fa8d7046a2c74f4fb7151ee03e539d08"}
{"date_startDate": "2018-11-20", "date_endDate": "2019-02-28", "time_startTime": "09:30:00", "time_endTime": "17:00:00", "location_address": "5801 Wilshire Blvd.", "location_city": "Los Angeles", "location_name": "Page Museum", "title": "La Brea Tar Pits", "description": "The world's most famous ice age excavation site also includes the adjoining Page Museum. Note: closed July 4, Thanksgiving, Christmas and Jan. 1.", "url": "https://www.laweekly.com/event/la-brea-tar-pits-4291109", "orgName": null, "ticket_info": [], "id": "LAweekly_ed43eb1cb1ef137fbaedcb7ea819b43a"}
{"date_startDate": "2018-11-21", "date_endDate": "2019-02-01", "time_startTime": "10:30:00", "time_endTime": "18:30:00", "location_address": "800 W. Olympic Blvd.", "location_city": "Los Angeles", "location_name": "Grammy Museum", "title": "The Prison Concerts: Folsom and San Quentin (Jim Marshall's Photographs of Johnny Cash)", "description": "By\n                \n                    Siran Babayan                \n\n                                    In the new book Johnny Cash at Folsom & San Quentin: Photographs by Jim Marshall, which includes a great foreword by singer Marty Stuart and text by Scott B. Bomar, there is, of course, a chapter dedicated to \"The Finger.\" Accounts of why Cash flipped the bird have always varied, and the infamous shot wasn't really widely used until the 1990s. But it's just one of many black-and-white and color images of Cash performing in prisons in 1968 and 1969 that are featured in the Grammy Museum's new exhibit, \"The Prison Concerts: Folsom and San Quentin (Jim Marshall's Photographs of Johnny Cash).\" Marshall, who died in 2010, was Woodstock's chief photographer and also was responsible for more than 500 album covers. Both the book and the exhibition capture not only Cash but the Carter Family, Carl Perkins and The Statler Brothers, in addition to Cash interacting with inmates, namely Glen Sherley, whose song \"Greystone Chapel\" was recorded by the country legend. In conjunction with the collection's opening, the museum hosts a panel discussion with Bomar and Marshall's former assistant, Amelia Davis.", "url": "https://www.laweekly.com/event/the-prison-concerts-folsom-and-san-quentin-jim-marshalls-photographs-of-johnny-cash-9978284", "orgName": null, "ticket_info": [], "id": "LAweekly_354bcebbe814e1edfe535cf32c71b2fd"}
{"date_startDate": "2018-11-20", "date_endDate": "2019-02-28", "time_startTime": "10:30:00", "time_endTime": "18:30:00", "location_address": "800 W. Olympic Blvd.", "location_city": "Los Angeles", "location_name": "Grammy Museum", "title": "Cheech & Chong: Still Rollin' \u2014 Celebrating 40 Years of Up in Smoke", "description": "By\n                \n                    Siran Babayan                \n\n                                    Cheech and Chong's Up in Smoke was released 40 years ago this year, man. The plot, as best \u2014 cough \u2014 we can remember, follows two stoners who meet in a car with license plates that read \"MUF DVR,\" and spend the rest of the movie chasing weed while being trailed by narcs. The Grammy Museum's latest exhibit, Cheech & Chong: Still Rollin' \u2014 Celebrating 40 Years of Up in Smoke, salutes not only the first stoner film ever made and its accompanying 1979 soundtrack, which featured the classic single \"Earache My Eye,\" but the history of one of comedy's greatest duos, Cheech Marin and Tommy Chong. Items on display include an original marked-up script, master tape for the album, comedy sketches and limited-edition anniversary smoking devices, in addition to art guitars from Marin's curated collection, Blazing Chicano Guitars.", "url": "https://www.laweekly.com/event/cheech-and-chong-still-rollin-celebrating-40-years-of-up-in-smoke-9373669", "orgName": null, "ticket_info": [], "id": "LAweekly_a4003376e86b15b2f663307ff914f58d"}
{"date_startDate": "2018-11-20", "date_endDate": "2019-02-28", "time_startTime": "08:00:00", "time_endTime": "17:00:00", "location_address": "1500 N. College Ave.", "location_city": "Santa Ana", "location_name": "Rancho Santa Ana Botanic Garden", "title": "Origami in the Garden", "description": "\"Created by Santa Fe-based artists Kevin and Jennifer Box, the exhibition will feature installations, gallery works, and the Boxs' own compositions as well as collaborative works with some of the world\u2019s top origami artists.\"", "url": "https://www.laweekly.com/event/origami-in-the-garden-9932256", "orgName": null, "ticket_info": [{"lowestPrice": "9"}, {"highestPrice": "9"}], "id": "LAweekly_c782b736ca004b0158ef1fd092004ba8"}
{"date_startDate": "2018-11-20", "date_endDate": "2019-02-28", "time_startTime": "None", "time_endTime": "None", "location_address": "900 Exposition Blvd.", "location_city": "Los Angeles", "location_name": "Natural History Museum of Los Angeles County", "title": "Becoming Los Angeles", "description": "By\n                \n                    Rena Kosnett                \n\n                                    No matter how thin your wallet, every first Tuesday (except in July and August), the 50,000-year-old Simi Valley mastodon can be your date. The Natural History Museum of Los Angeles County's halls of herpetology, ichthyology and mineralogy are open once a month to broke Angelenos dying to keep tabs on the world's ancient life. The Dinosaur Hall and \"Becoming L.A.\" are new and exciting exhibits -- the latter a 14,000-square-foot display of the story of Los Angeles in six parts: the time of Spanish contact; the Spanish Mission era; the Mexican rancho era; the early American period; the emergence of a new American city in the late 19th and early 20th centuries; and the Great Depression and World War II to the present. You must admit, the tagline for this new exhibit, \"Cow Poop Changed L.A.,\" is quite an attention grabber. Natural History Museum of Los Angeles County, 900 Exposition Blvd., Exposition Park; first Tuesdays, 9:30 a.m.-5 p.m.; free. (213) 763-DINO, nhm.org.", "url": "https://www.laweekly.com/event/becoming-los-angeles-4291032", "orgName": null, "ticket_info": [], "id": "LAweekly_7f6f9dd5773f1682cff95b7286887f70"}
