{"date_startDate": "2018-11-20", "date_endDate": "2019-02-28", "time_startTime": "None", "time_endTime": "None", "location_address": "428 N. Fairfax Ave.", "location_city": "Los Angeles", "location_name": "Blitzstein Museum of Art", "title": "BLiTZSTEiN's Wooden Boards", "description": "L.A. Art Exhibit!\nBLiTZSTEiN\u2019S \nWooden Boards\nNow Through March 23, 2016\n~\nBLITZSTEIN MUSEUM OF ART\n428 N. Fairfax Ave.\nLos Angeles 90036\n~\nFolksy! Original! Brilliant! Merry!\nThe characters call out to Blitzstein from the grains and knots of natural wood\nRather than painting the characters, he paints AROUND them, adding his delightful props and environs to hilight the main features yet allow them to remain untouched as sculpted by the life of the tree.  \nTruly a collaborative method, Blitzstein partners with nature to give life to some of his most memorable and famous characters.\nHarry and I, Curator Sebastian, invite you into the gallery for a first look at this exhibition, this Saturday night.\nThere\u2019s nothing like it in town!\nL.A.\u2019s longest-running one-man art gallery!\n~\nBlitzstein\u2019s Wooden Board Show will be up until we bring in the perfect Easter Show:  CRUCIFIXIONS!\n~\nOur hours are expanding!  \nNow open some afternoons as well as weekend late nights!\nSelect Halloweenies are still on display in the mezzanine.\nEmail about our other events:\nFilm Festivals\nOpen Mic Poetry (DECEMBER 19, 9 pm\nMusic Jams (DECEMBER 12, 9 pm\n\nLots of affordable paintings in the gallery now, as well as a fabulous sale of prints starting at just $10\n\n~Sebastian Vale\nCurator\nBlitzstein Museum of Art\nFind us on LAWeekly, Yelp, Facebook, Etsy, Ebay, Instagram, YOUTUBE and more!", "url": "https://www.laweekly.com/event/blitzsteins-wooden-boards-6356224", "orgName": null, "ticket_info": [], "id": "LAweekly_2182f97465caf6d60ced54d5b4bad07a"}
{"date_startDate": "2018-11-20", "date_endDate": "2019-02-28", "time_startTime": "09:00:00", "time_endTime": "16:00:00", "location_address": "1010 Broad St.", "location_city": "San Luis Obispo", "location_name": "San Luis Obispo Museum of Art", "title": "Capturing the Essence of the Landscape with Elizabeth \"Libby\" Tolley", "description": "The focus of this workshop is capturing the essence of the landscape with oil paint.\n\nThis 4-day workshop will include two days on location (weather permitting) and two days in the studio.\n\nTwo days will be classroom work working from photographs creating value studies, color studies and creating a painting from the studies and reference material.\n\nThe plein air painting days will take all the studio study into the field and we will paint from life capturing the natural light.\n\nDesign and composition, perspective, color mixing, and palette organization will be addressed.\n\nAfter the workshop, artists will have the tools to create paintings that express their vision.\n\nThis is a fast paced class and built on many years of teaching landscape painting. Recommended for intermediate and advanced painters.", "url": "https://www.laweekly.com/event/capturing-the-essence-of-the-landscape-with-elizabeth-libby-tolley-8091889", "orgName": null, "ticket_info": [{"lowestPrice": "445"}, {"highestPrice": "445"}], "id": "LAweekly_49e13798b40f4571eaae803bdfb46ca0"}
