{"date_startDate": "2018-11-20", "date_endDate": "2019-02-28", "time_startTime": "None", "time_endTime": "None", "location_address": "2437 Main St.", "location_city": "Santa Monica", "location_name": "Edgemar Center for the Arts", "title": "SUMMER CAMPS FOR CHILDREN AND TEENS", "description": "SUMMER CAMPS FOR CHILDREN AND TEENS \n \nSinging Camp for Children & Teens\nDo you love to act, sing and dance? This high energy singing Summer Camp will incorporate acting, singing, and dancing. We will create our own mini version of a musical.\nTuition: $535\n*Only the week of July 17th and July 31 is currently open for the singing camp. \nIf you would like to be placed on a wait list please let us know.\n Please call 310-392-0815 to place a deposit or if you have any questions.   \n Make A Movie Camp \nA different film is made each week.\nStudents will write and star in their own original short film.  \nWe will guide them as they take their thoughts and ideas to the page, and from the page to the screen.   This is a one-of-a-kind experience, and we are thrilled to be able to  to see what ideas our students come up with and help make it a reality on screen!\nMonday thru Friday 9am-3:30pm\nTuition is $780\n     Please call 310-392-0815 to place a deposit or if you have any questions.     \nActing and Improv Camp\nDevelop a solid acting technique and foundation.\nIMPROV WORKOUT: Fun improvisational games & exercises.\nAUDITIONING FOR FILM AND TELEVISION ON CAMERA: Practice auditioning techniques & get on camera experience.\nSCENE STUDY: The best way to learn is though hands on experience with direction. Work on scenes & monologues\nVOICE INTENSIVE: Vocal and speech exercises.\nMonday thru Friday 9am-3:30pm\nTuition is $535\n Please call 310-392-0815 to place a deposit or if you have any questions.    \n   Below is a list of camps dates that are still open.\nJUNE 12TH \u2013 JUNE 16TH\nJUNE 19TH \u2013 JUNE 23RD\nJUNE 26TH \u2013 JUNE 30TH  \nJULY 10TH \u2013 JULY 14TH \nJULY 31ST \u2013 AUGUST 4TH\nAUGUST 7TH \u2013 AUGUST 11TH\nAUGUST 14TH \u2013 AUGUST 18TH\nAUGUST 21ST \u2013 AUGUST 25TH\n \nFor more information about kids summer camps please email us at:\ninfo@michelledanner.com\nor call (310) 392-0815", "url": "https://www.laweekly.com/event/summer-camps-for-children-and-teens-8164534", "orgName": null, "ticket_info": [{"lowestPrice": "535"}, {"highestPrice": "535"}], "id": "LAweekly_9fcededc6813165e104f4dc6a0cab8b8"}
