{"date_startDate": "2018-11-20", "date_endDate": "2019-02-28", "time_startTime": "09:00:00", "time_endTime": "21:00:00", "location_address": "2437 main st", "location_city": "Santa Monica", "location_name": "Edemar center", "title": "FILM FESTIVAL LOS ANGELES", "description": "ARRIVING APRIL 27TH - 30TH 2017\nFour days of screenings, parties and artist programs that celebrate independent film making in the heart of Santa Monica.\n\n Housed at the Edgemar Center for the Arts, the CATE Film Festival Los Angeles is nestled in the Frank Gehry designed complex on bustling Main Street in Santa Monica, California. The 5th Annual Cinema at the Edge Independent Film Festival (CATE) presents films of all genres that feature a distinct vision, a unique voice or a challenge to what is expected and accepted in the medium. A community staple, CATE was born out of a desire to showcase innovative films, with a commitment to quality, which push industry boundaries and explore cutting-edge cinema.\nOur film festival is now accepting submissions for Narrative Features, Documentaries, and Shorts. We emphatically welcome films in all genres, from all corners of the world, whether you\u2019re a student or a seasoned filmmaker. It is CATE\u2019s mission to feature films which will, first and foremost, connect with audiences but also give independent filmmakers genuine exposure and additional opportunities for global distribution. This film festival is dedicated to shining the light on indie gems which continue to push this industry to new heights. Festival Director Michelle Danner is thrilled to now invite the global independent film community to submit their finest work to this vibrant, beachside community during CATE 2017.\n EARLY DEADLINE: October 31, 2016\nREGULAR DEADLINE: January 2, 2016\nLATE DEADLINE: MARCH 15, 2017\nVisit Withoutabox or FilmFreeway for more information on how to submit YOUR film!\nemail us at cinemaattheedge@gmail.com\n\n2437 Main St, Santa Monica, CA 90405", "url": "https://www.laweekly.com/event/film-festival-los-angeles-7790679", "orgName": null, "ticket_info": [{"lowestPrice": "0"}, {"highestPrice": "250"}], "id": "LAweekly_47d6ef539afdbe9eb16c99bc12a84a23"}
{"date_startDate": "2018-11-20", "date_endDate": "2019-02-28", "time_startTime": "None", "time_endTime": "None", "location_address": "1215 Cushman Ave.", "location_city": "San Diego", "location_name": "Online Contest", "title": "L.A. Art Contest: LA VICTORIA\u00ae Brand Gives Back to Local Artists for 100th Anniversary", "description": "To commemorate its 100th anniversary this year, the makers of the LA VICTORIA\u00ae brand, the iconic, Southern California-based maker of salsas, taco sauces, enchilada sauces and chiles, today announced an art contest in Los Angeles to help bring to life its embodiment of the \u201cModern West Coast Lifestyle.\u201d From now until May 10, the makers of the LA VICTORIA\u00ae brand invite Los Angeles artists to submit original artwork to be considered for an opportunity to participate in the brand\u2019s commemorative anniversary celebration on June 1. Five finalists will be selected to attend the dinner; one will be awarded a grand prize of $7,500, while the second- and third-place winners will take home $1,500 and $1,000, respectively. All finalists will also receive salsa prize packs.\nTo enter, residents must submit photographs of five original works of art; any form of the visual arts will be considered. Five finalists will be chosen and asked to create one additional piece of art that embodies the LA VICTORIA\u00ae brand and its philosophy of the \u201cModern West Coast Lifestyle.\u201d Be it a Venice Beach scene, a view of the city from Griffith Park, or a Solstice Canyon hike, artists are encouraged to bring their creativity while giving an artistic nod to the LA VICTORIA\u00ae brand. The finalists will exhibit these works at the celebration dinner. \n\u201cWe\u2019re excited to connect our iconic brand with local fans as a way to honor LA VICTORIA\u00ae Brand\u2019s past, celebrate the present, and inspire the future,\u201d said LA VICTORIA\u00ae Brand Manager Sebastian Friedman. \u201cOur art contest is just one of several ways we are paying tribute to our West Coast roots and the authentic culinary traditions we\u2019ve inspired for now a century.\u201d \nThe celebration in Los Angeles will take place Thursday, June 1, at the Santa Monica Pier and Carousel. In addition to showcasing the artwork of the contest finalists, the brand will partner with Eddie Ruiz, renowned chef at Corazon y Miel in Long Beach, to honor Mexican-American culture and tradition while celebrating LA VICTORIA\u00ae Brand\u2019s modern, West Coast approach. The San Diego dinner occurs on May 11, and following the Los Angeles event, the makers of the LA VICTORIA\u00ae brand will travel to San Francisco and Portland to continue the festivities.\nFor Official Rules or to enter the art contest, visit http://lavictoria.com/100Years during the entry period and submit five works of art and other requested materials. For more information about LA VICTORIA\u00ae foods, visit http://www.lavictoria.com.", "url": "https://www.laweekly.com/event/la-art-contest-la-victoria-brand-gives-back-to-local-artists-for-100th-anniversary-8174128", "orgName": null, "ticket_info": [], "id": "LAweekly_f6852c4a80e0a01da56968550c49cf3e"}
