{"date_startDate": "2018-11-20", "date_endDate": "2019-02-28", "time_startTime": "10:00:00", "time_endTime": "17:00:00", "location_address": "11800 Foothill Blvd.", "location_city": "Los Angeles", "location_name": "Discovery Cube in Los Angeles", "title": "Storyland: A Trip Through Childhood Favorites", "description": "In this highly immersive and engaging exhibit, families discover the joy and power of reading at any age. Imagine stepping into the world of your favorite storybooks \u2014 building a snowperson and making snow angels in The Snowy Day, tucking in Peter Rabbit, and finding Spot.\n\nExhibit experiences including matching, rhyming, poetry and storytelling all help set the foundation for becoming literate by encouraging children to love books, learn words, tell stories, read everything, know letters, and hear sounds. Featured books in the 1,500 square foot exhibit are The Tale of Peter Rabbit by Beatrix Potter, If You Give a Mouse a Cookie by Laura Numeroff, Chicka Chicka Boom Boom by Bill Martin Jr. and John Archambault, The Snowy Day by Ezra Jack Keats, Abuela by Arthur Dorros, Tuesday by David Wiesner, and Where\u2019s Spot? by Eric Hill.\n\nDiscovery Cube is located at 11800 Foothill Blvd., Los Angeles. Admission is available on-site or online at www.discoverycube.org/la/. General admissions grand opening promotional prices are as follows: adult ($17.95), senior ($14.95), children ages 3-14 ($12.95) and children ages 2 and under (Free).", "url": "https://www.laweekly.com/event/storyland-a-trip-through-childhood-favorites-6459515", "orgName": null, "ticket_info": [{"lowestPrice": "17"}, {"highestPrice": "14"}], "id": "LAweekly_80decfce05af642a2e18cc022a79e67d"}
