{"date_startDate": "2018-11-20", "date_endDate": "2019-02-28", "time_startTime": "09:00:00", "time_endTime": "16:00:00", "location_address": "1010 Broad St.", "location_city": "San Luis Obispo", "location_name": "San Luis Obispo Museum of Art", "title": "Loose and Atmospheric Watercolors with Frank Eber", "description": "Bring your painting skill to a higher level! Learn how to paint luminous watercolors by manipulating tonal values, color and edge. In this class, Frank Eber will share advanced painting techniques to create atmosphere, balance, and unity in your work. Topics will include design and composition, color and lighting, positives and negatives, simplification of shape, and atmospheric effects. The techniques you will learn in Frank\u2019s workshop transcend the watercolor medium, as they are applicable to oils, acrylics, tempera, pastels, and more.\n\nSeparate yourself from the watercolor crowd and experience firsthand why his courses are so popular!\n\nAll levels are welcome but students should have an understanding of the watercolor medium He stresses a solid foundation in the basics, \u201c\u2026so that our focus is on creating timeless art. An emotional link is necessary in our work, as well as the connection to the vibrancy of everything we paint.\u201d\n\nAbout the Instructor\nA painter's painter, Frank Eber works in a direct, loose style influenced by the Old World masters. Typical in his art are color mixes and light that evoke nostalgia while remaining absolutely in the present. Frank's watercolor workshops reach beyond technique, encouraging individual expression and observing the elusive balance of forces that create beauty in painting.\n\nFrank Eber has acted as Juror for many top-notch exhibitions, including the Central Coast Watercolor Society's Aquarius 2016 exhibition in SLOMA's Gray Wing. His work has been selected for numerous watercolor publications including International Artist Magazine and Plein Air Magazine and he teaches watercolor workshops nationally and internationally.", "url": "https://www.laweekly.com/event/loose-and-atmospheric-watercolors-with-frank-eber-8092285", "orgName": null, "ticket_info": [{"lowestPrice": "345"}, {"highestPrice": "3"}], "id": "LAweekly_f50e6576b8407c552d0e5ed80c28f435"}
{"date_startDate": "2018-11-20", "date_endDate": "2019-02-28", "time_startTime": "11:00:00", "time_endTime": "17:00:00", "location_address": "647 Mateo St.", "location_city": "Los Angeles", "location_name": "Artists and Fleas", "title": "Artists and Fleas Weekend Market", "description": "It's a New Year, a New Start and we have New Faces at the market.  Artists and Fleas returns to the DTLA Arts District for the first show of the year with over 90 booths filled with the best local art, design and vintage vendors in Los Angeles. \n\nNew comers, Lockjaw Garage will join us with benches made from repurposed truck parts while Dig It Vinyl and Beatology Records are coming with bins of records that you'll get lost looking through for hours.\n\nMake sure to bring the little ones this month-  as Raditude Apparel, From Pepper, Dill Clothing, and  MyLO's adorable leather shoes will be offered. Your kids will leave looking cooler than you.....\n\nThis month Artists and Fleas will also host the 'Will Wall' - a place for shoppers to take a moment, reflect on what their intentions are for the New Year and to share it with us on a sticky note among hundreds of others.  \n\nStarting your shopping later in the day? Make sure to stop by (or come back!) at 3:30pm on either day-  25 free tote bags will be given away with 3 bags containing a suprise gift certificate ranging from $25-$50!", "url": "https://www.laweekly.com/event/artists-and-fleas-weekend-market-6476620", "orgName": null, "ticket_info": [], "id": "LAweekly_e0344cb72ac8011a14fa947881712a69"}
