{"date_startDate": "2018-11-21", "date_endDate": "2019-01-06", "time_startTime": "None", "time_endTime": "None", "location_address": "301 N. Baldwin Ave.", "location_city": "Arcadia", "location_name": "L.A. County Arboretum & Botanic Garden", "title": "Moonlight Forest Lantern Art Festival", "description": "By\n                \n                    Avery Bissett                \n\n                                    Halloween may be the time of the year for jack-o'-lanterns and other creepy glow-in-the-dark art, but it's a decidedly less macabre and lighter affair at the Moonlight Forest Lantern Art Festival. The Chinese-influenced (from the Sichuan province, to be exact), mile-long installation features a cornucopia of lantern art based on the themes of nature, children's garden and Chinese culture. And it wouldn't be a festival without the requisite food and drink offerings, including the Triple Threat Truck, Son of a Bun and several other food trucks. If a particular evening is sold out, fear not; use ride-sharing to get to the Arboretum, show your receipt and you'll be able to buy up to four tickets.", "url": "https://www.laweekly.com/event/moonlight-forest-lantern-art-festival-10000919", "orgName": null, "ticket_info": [{"lowestPrice": "28"}, {"highestPrice": "28"}], "id": "LAweekly_8fe5fe9d98f56a3aa51d9b8755f4ac72"}
