{"date_startDate": "2018-11-29", "date_endDate": "2019-01-19", "time_startTime": "19:00:00", "time_endTime": "21:00:00", "location_address": "148 N. La Brea Ave.", "location_city": "Los Angeles", "location_name": "Fahey/Klein Gallery", "title": "Mark Seliger", "description": "By\n                \n                    Shana Nys Dambrot                \n\n                                    Fahey/Klein Gallery has a special knack for presenting compelling work by renowned editorial and fashion photographers, culling exhibitions from both their marquee careers and personal explorations. For example, Mark Seliger's decades of iconic portraiture has elevated the game from Rolling Stone to Vanity Fair, GQ, Elle and Vogue in depictions of titans in music, art, fashion, business and politics: Johnny Cash, Barack Obama, Laurie Anderson, Muhammad Ali, Bob Dylan, Matthew Barney, Cindy Sherman and the Dalai Lama. The classically cool style of Seliger's black-and-white photographs and the sophisticated, refined color palette of his glossies capture both the persona and the personality of his subjects. His newest book, which features an interview conducted by Judd Apatow, accompanies the exhibition, and there's a gallery talk and book signing with KCRW's Jason Bentley on Saturday, Dec. 1, 2-4 p.m.", "url": "https://www.laweekly.com/event/mark-seliger-10076420", "orgName": null, "ticket_info": [{"lowestPrice": "0"}, {"highestPrice": "0"}], "id": "LAweekly_9e2e61f956ba19d8eb2d809077225576"}
{"date_startDate": "2018-11-23", "date_endDate": "2019-01-06", "time_startTime": "None", "time_endTime": "None", "location_address": "3649 Mission Inn Ave.", "location_city": "Riverside", "location_name": "Mission Inn Hotel", "title": "The 26th Annual Festival of Lights", "description": "Southern California\u2019s historic AAA Four-Diamond hotel \u2013 kicks off the holiday season on Friday, November 23 with the annual Festival of Lights, a complimentary, six week-long celebration featuring one of the nation\u2019s largest holiday public light collections of its kind.  This year marks the 26th anniversary of the annual tradition, a gift from Keepers of the Inn Duane and Kelly Roberts, who saved the historic hotel from destruction in 1992. The festivities commence with the famous \u201cSwitch-On\u201d Ceremony, a spectacular event in which the hotel is instantly illuminated in holiday lights followed by a full fireworks display.", "url": "https://www.laweekly.com/event/the-26th-annual-festival-of-lights-10052739", "orgName": null, "ticket_info": [{"lowestPrice": "0"}, {"highestPrice": "0"}], "id": "LAweekly_b24e66a5807ac6e1a6e489d7f5cf5229"}
{"date_startDate": "2018-11-20", "date_endDate": "2019-01-06", "time_startTime": "11:00:00", "time_endTime": "18:00:00", "location_address": "901 E. Third St.", "location_city": "Los Angeles", "location_name": "Hauser & Wirth", "title": "Hauser & Wirth L.A.", "description": "By\n                \n                    Shana Nys Dambrot                \n\n                                    Three new shows open this weekend at Arts District bastion Hauser & Wirth L.A. A massive sculpture by Alexander Calder activates the central courtyard, as some 30 smaller stabiles and mobiles fill an interior gallery and the adjacent garden. New York artist Zoe Leonard (also the subject of a new show at MOCA) presents her epic \"Analogue\" cycle, in which she documents the disappearing mom-and-pop storefronts of the Lower East Side from 1998 to 2009. Her 400-plus images capture a period of gentrification that she links to issues of capitalism, colonialism and cultural agency \u2014 issues denizens of the Arts District know a lot about themselves. Finally, artist and filmmaker Julian Rosefeldt's triumphant feature Manifesto, in which Cate Blanchett enacts the artistic philosophies of a series of the 20th century's most influential creative movements in high-production character with humanity, passion and a mind-blowing mimicry, will be shown in its original concept as a 13-channel video installation.", "url": "https://www.laweekly.com/event/hauser-and-wirth-la-10000922", "orgName": null, "ticket_info": [{"lowestPrice": "0"}, {"highestPrice": "0"}], "id": "LAweekly_8abbf2b309dbc408f4b708144711aa00"}
{"date_startDate": "2018-11-20", "date_endDate": "2019-01-06", "time_startTime": "09:00:00", "time_endTime": "16:00:00", "location_address": "415 Pacific Coast Highway", "location_city": "Santa Monica", "location_name": "Annenberg Community Beach House", "title": "Life in This Ocean", "description": "By\n                \n                    Shana Nys Dambrot                \n\n                                    The seaside fun and cultural center that is the Annenberg Beach House is home to many fine-weather amenities, but this weekend it's the gallery space rather than the swimming pool that's the destination, as the four-person exhibition \"Life in This Ocean\" opens with a special afternoon artists reception. Each of the artists \u2014 Deirdre Sullivan-Beeman, Kathy Taslitz, Donna Bates and Lena Rushing \u2014 employs a distinct and unconventional technique, from mixed-media assemblage to old-school egg tempera, in modes of pop surrealism and political inflection. With portraits and landscapes that evoke and deconstruct what life in L.A. is like at its prettiest, most volatile, challenging and inspirational, \"Life in This Ocean\" explores the ways in which living here influences how we see ourselves.", "url": "https://www.laweekly.com/event/life-in-this-ocean-9897103", "orgName": null, "ticket_info": [{"lowestPrice": "0"}, {"highestPrice": "0"}], "id": "LAweekly_bcfcc9bf582174ceaf5cdbd5b309b923"}
{"date_startDate": "2018-11-20", "date_endDate": "2019-01-06", "time_startTime": "09:30:00", "time_endTime": "17:00:00", "location_address": "900 Exposition Blvd.", "location_city": "Los Angeles", "location_name": "Natural History Museum of Los Angeles County", "title": "Wildlife Photographer of the Year", "description": "By\n                \n                    Siran Babayan                \n\n                                    Launched in 1964 at the Natural History Museum in London, the \"Wildlife Photographer of the Year,\" the largest touring wildlife photography exhibit in the world, makes its West Coast debut. The 99 animal portraits and landscapes on display were culled from some 50,000 entries for this year's competition by photographers from nearly 100 countries, who competed in more than a dozen categories, including mammals, birds, reptiles, and plants and fungi. Among the artists highlighted is South African photographer and 2017 winner Brent Stirton, whose Memorial to a Species features a de-horned rhinoceros in South Africa shot to death by poachers.", "url": "https://www.laweekly.com/event/wildlife-photographer-of-the-year-9685993", "orgName": null, "ticket_info": [{"lowestPrice": "21"}, {"highestPrice": "21"}], "id": "LAweekly_e943e129f2ca369118da11014b4ba6e4"}
