{"date_startDate": "2018-12-06", "date_endDate": "2019-01-03", "time_startTime": "None", "time_endTime": "None", "location_address": "2827 Avenel St", "location_city": "Los Angeles", "location_name": "A tennis court behind", "title": "Match Point! Comedy", "description": "Who needs a comedy club or a bar when you can watch a comedy show in a full tennis court? Hosted by Isaac Hirsch, Luke Wienecke, and Gil Alvarisaez, come enjoy snacks, drinks, and the ambiance of Wimbledon, along with some of the biggest names in comedy. With past performances from Aparna Nancherla and Todd Glass, along with an unprecedented snack table, this is one *ace* of a comedy show.", "url": "https://www.laweekly.com/event/match-point-comedy-10025848", "orgName": null, "ticket_info": [{"lowestPrice": "0"}, {"highestPrice": "0"}], "id": "LAweekly_0c576206706378f3d76de7091cca6dd6"}
{"date_startDate": "2018-11-20", "date_endDate": "2019-01-05", "time_startTime": "11:00:00", "time_endTime": "17:00:00", "location_address": "5814 Wilshire Boulevard", "location_city": "Los Angeles", "location_name": "Craft And Folk Art Museum", "title": "Sherin Guirguis, Merion Estes and Uzumaki Cepeda", "description": "By\n                \n                    Shana Nys Dambrot                \n\n                                    Faux fur, found textiles, cut paper and paint \u2014 three accomplished woman bring new works to the public for the Craft & Folk Art Museum's September season. Sherin Guirguis works in painting, sculpture and installation to create abstract, architecturally engaged works combining traditional Egyptian pattern aesthetics with personal and historical biography. Merion Estes wields fabric collage, photo-transfer and painting in large-scale works that represent a post-apocalyptic landscape both colorful and entropic, in exuberant if dire cautionary tales. Uzumaki Cepeda creates \"soft spaces\" from a compendium of faux fur and found objects, referring to the human need for comfort and safety amid the swirling storms of an uncertain modern life.", "url": "https://www.laweekly.com/event/sherin-guirguis-merion-estes-and-uzumaki-cepeda-9897106", "orgName": null, "ticket_info": [{"lowestPrice": "7"}, {"highestPrice": "7"}], "id": "LAweekly_881dde2427e85f5a8bd72946175dcb3d"}
