{"date_startDate": "2018-11-20", "date_endDate": "2019-01-03", "time_startTime": "None", "time_endTime": "None", "location_address": "200 Santa Monica Pier", "location_city": "Santa Monica", "location_name": "Santa Monica Pier", "title": "Wonderland on the Water", "description": "By\n                \n                    Falling James                \n\n                                    Myriad Slits is best known as the fiery, provocative singer of local post-punk experimentalists ModPods but she is also an artist who creates strange, unsettling work involving dreamlike masked creatures and other surreal apparitions in long gowns. She applies her fantastic visual sense to a seemingly homey holiday display at the Santa Monica Pier titled Wonderland on the Water. Slits will take over the Santa Monica Looff Hippodrome, which houses the pier's vintage carousel, and fill its windows with a Seadragons Village populated with handcrafted and hand-painted marine animals designed in her unique style. \"It's my first time ever doing anything where I was given full resources to materials and space,\" Slits says.", "url": "https://www.laweekly.com/event/wonderland-on-the-water-10064139", "orgName": null, "ticket_info": [{"lowestPrice": "0"}, {"highestPrice": "0"}], "id": "LAweekly_bdcada9ab63d3ca562ac0ae14c6fbabd"}
{"date_startDate": "2018-11-22", "date_endDate": "2019-02-28", "time_startTime": "None", "time_endTime": "None", "location_address": "5919 Franklin Ave.", "location_city": "Los Angeles", "location_name": "UCB Franklin", "title": "Last Day of School: The Txt Msg Show / Convoy", "description": "By\n                \n                    Stephanie Carrie                \n\n                                    Anonymous once said, \"You get what you pay for.\" In regards to the McDonald's dollar menu, Anonymous was probably right, but he was dead wrong about the doubleheader improv show at the Upright Citizens Brigade: \"Last Day of School\" and \"Convoy.\" For $5 at 11 p.m. on Thursdays you can see two of the most seasoned and reliably hilarious improv teams in town. \"LDoS\" improvises scenes based on audience text messages. \"Convoy\" asks for a one-word suggestion and wows audiences with the esoteric specificity of its scenes and the \"juxtaposition of the fantastic and mundane,\" as member Alex Berg adroitly put it. \"LDoS\" members have written and performed on shows such as Saturday Night Live, Happy Endings, Comedy Bang Bang and Adult Swim's Newsreaders. You may recognize \"Convoy's\" trio of performers as the ingeniously helpful losers Swift, Blodget and Gunt from FX's short-lived Terriers. Who knows what this doubleheader of Hollywood's comedy elite could inspire in you? (Be sure to check website for exact schedule.)", "url": "https://www.laweekly.com/event/last-day-of-school-the-txt-msg-show-convoy-4757660", "orgName": null, "ticket_info": [], "id": "LAweekly_3dd7098a944eb8aa132d85dfcee3fe84"}
{"date_startDate": "2018-11-20", "date_endDate": "2019-01-05", "time_startTime": "10:00:00", "time_endTime": "18:00:00", "location_address": "45 N. Venice Blvd.", "location_city": "Venice", "location_name": "L.A. Louver", "title": "Matt Wedel", "description": "By\n                \n                    Shana Nys Dambrot                \n\n                                    Ceramics has been having an extended moment of popularity and acclaim in fine-art circles, as more and more contemporary artists embrace the appeal of this slow, heavy, messy medium. Not content to simply appreciate the appeal of this exceptionally analog and physical material, perhaps as a countermeasure against the surge of the digital and virtual, new generations of sculptors are pressing tradition into the service of the modern. One of the most intriguing voices in the clay conversation has been Matt Wedel, whose new show, \"Everything is everything,\" opens in Venice this week. Wedel's unique vision merges his own family background (his dad is a potter) with art historical confidence and expressively personal narrative to create eccentric, painterly ceramic sculptures that innovatively interpret elements from natural and psychological landscapes.", "url": "https://www.laweekly.com/event/matt-wedel-10043920", "orgName": null, "ticket_info": [{"lowestPrice": "0"}, {"highestPrice": "0"}], "id": "LAweekly_1d56d2a69301298eb14acbdcc2125f03"}
