{"date_startDate": "2019-01-27", "date_endDate": "2019-01-27", "time_startTime": "09:30:00", "time_endTime": "17:00:00", "location_address": "4501 Casa Loma Ave", "location_city": "Yorba Linda", "location_name": "Yorba Linda Community Center", "title": "California comic convention ( CalComicCon) 2016", "description": "On Sunday, January 31, 2016 the California Comic Convention will celebrate their 10th year for the show at the Yorba Linda Community Center in Orange County, CA. The convention is focused on vintage comics and comic art and will host dozens of dealers from all over the U.S. with great collecting opportunities for fans.\n\nGuest artists at the show are Joe Jusko (The Savage Sword of Conan, Incredible Hulk, The Punisher) and Paul Gulacy (Batman, Catwoman, Sabre: Slow Fade of an Endangered Species). They will be creating sketches and signing autographs throughout the day.\n\nCGC will be there to take submissions and witness original signatures by the guest artists.\n\nThe convention will hold raffles for dozens of items throughout the day that will include CGC graded books, original comic pages, and sketches from the guest artists.\n\nThe con will begin at 9:30 AM and run through 5 PM. The Yorba Linda Community Center is located at 4501 Casa Loma Avenue, Yorba Linda, CA. Tickets are only $10 and can be purchased in advance on the website.", "url": "https://www.laweekly.com/event/california-comic-convention-calcomiccon-2016-6511199", "orgName": null, "ticket_info": [{"lowestPrice": "10"}, {"highestPrice": "10"}], "id": "LAweekly_9d4eaa05c59edd0bd2c723b2f2680d93"}
{"date_startDate": "2019-01-25", "date_endDate": "2019-01-25", "time_startTime": "None", "time_endTime": "None", "location_address": "9081 Santa Monica Blvd.", "location_city": "West Hollywood", "location_name": "The Troubadour", "title": "Lera Lynn with special guest, Thomas Dybdahl", "description": "Evening of original pop/indie/singer-songwriter music.\n\n\nALL AGES.\n\nLera Lynn heads west with special guest, Thomas Dybdahl, to the Troubadour on 1/25 to kick off her 2019 US touring. Lera will perform songs from her catalog of 5 studio albums, including her latest, critically-acclaimed duets album, Plays Well With Others, as well as music from her time on HBO's True Detective.\nJoining her as a special guest is Norwegian pop artist, Thomas Dybdahl whose album, What's Left Is Forever, was nominated for a Grammy.", "url": "https://www.laweekly.com/event/lera-lynn-with-special-guest-thomas-dybdahl-10059415", "orgName": null, "ticket_info": [{"lowestPrice": "22"}, {"highestPrice": "25"}], "id": "LAweekly_919f75fea58b7b1cf9f13f03b24008f3"}
