{"date_startDate": "2018-11-22", "date_endDate": "2019-02-28", "time_startTime": "21:00:00", "time_endTime": "22:30:00", "location_address": "4212 W. Sunset Blvd.", "location_city": "Los Angeles", "location_name": "El Cid", "title": "Was ist das? Cabaret comedy show", "description": "A Circus variety show set in the raucus days of Berlin 1924 that is dedicated to presenting lively and inventive performances ranging from the absurd to the sublime! On any given night you might see Burlesque, Puppetry, Clown, Mime, Dance troupes, Solo Character sketch, Musical numbers, and a variety of Acrobatic & Circus perfomers doing their thing. Your hosts Gretel Heinz & Hermann Schnitzel do their best to keep the sense of the 20\u2019s alive and ROARING.", "url": "https://www.laweekly.com/event/was-ist-das-cabaret-comedy-show-7903584", "orgName": null, "ticket_info": [{"lowestPrice": "10"}, {"highestPrice": "10"}], "id": "LAweekly_9379a265fc77869f808aa8bac484f017"}
{"date_startDate": "2018-11-30", "date_endDate": "2019-02-22", "time_startTime": "10:00:00", "time_endTime": "11:30:00", "location_address": "6562 Hollywood Blvd.", "location_city": "Hollywood", "location_name": "Hollywood Property Owners Alliance", "title": "Old Hollywood Walking Tour", "description": "The Old Hollywood walking tour explores history hidden in plain sight \u2013 the real town behind the tinsel. This new public tour tells the story of how Hollywood started as a sleepy little town of orange groves and wealthy retirees and became the center of the world\u2019s entertainment industry \u2013 in fewer than 50 years. \n\nTour stops include some of the key catalysts that were part of this historic transformation:\n\u2022\tHollywood\u2019s first and most famous movie theaters\n\u2022\tThe first tourist attraction in Hollywood\n\u2022\tThe oldest remaining residence on the Boulevard\n\u2022\tThe oldest restaurant in Hollywood, where Charlie Chaplin and Douglas Fairbanks unwound after a long day of filming, and where writers like F. Scott Fitzgerald and Ernest Hemingway wrote classic American novels\nAlong the way guests will see how the story of Hollywood is still unfolding as modern-day artists and creatives continue to reinvent their neighborhood while honoring its storied past.", "url": "https://www.laweekly.com/event/old-hollywood-walking-tour-8224567", "orgName": null, "ticket_info": [{"lowestPrice": "20"}, {"highestPrice": "20"}], "id": "LAweekly_5919b3f466987ac958c9be3689b80d92"}
