{"date_startDate": "2018-11-23", "date_endDate": "2019-02-22", "time_startTime": "18:00:00", "time_endTime": "21:00:00", "location_address": "4th Street between Hermosa and Temple", "location_city": "Long Beach", "location_name": "Retro Row / 4th Street", "title": "4th Fridays on 4th Street", "description": "Fourth Fridays On Fourth Street\nRetro Row Businesses Launch Community Event April 28\n\nLONG BEACH, CALIF. \u2014 Fourth Street\u2019s Retro Row, a vintage-focused shopping and dining district between Temple and Hermosa avenues, is debuting a new, free community event series this month on Friday, April 28.\n\nActivating the business district on the Fourth Friday of every month, from about 6 to 9 p.m., attendees can expect to enjoy extended store hours, food and drink specials, discounted merchandise, pop up shops, art shows, live music and more along the thoroughfare.\n\nThe event is free and open to the public. \n\n\u201cFourth Street\u2019s Retro Row is all about nostalgia, but we are also working to forge a new era along our busy thoroughfare,\u201d Co-President Kerstin Kansteiner, owner of Portfolio Coffeehouse (2300 E. Fourth St.), said. \n\n\u201cWhen I opened Portfolio in 1990, there were only a handful of businesses here, but it\u2019s really become a place where you can spend the whole day \u2014 it\u2019s become a thriving business district known throughout the region for it\u2019s funky, vintage vibe,\u201d she said. \u201cThere\u2019s so much momentum building here, and we want to keep that going, which is why our shopkeepers have decided to host monthly events in addition to some of our annual favorites, which we will continue doing.\u201d\n\nEach month\u2019s Fourth Fridays event will have a theme, and April\u2019s theme will be \u201cThe Power of Women,\u201d inspired by a photography exhibit with the same name opening April 28 at The Social List (2105 E. Fourth St.).\n\n\nWalking or biking to the event is strongly encouraged.\n\nAdditional activities and updates will be posted on social media and online at 4thStreetLongBeach.com. \n\nABOUT FOURTH STREET\u2019S RETRO ROW \nThe Fourth Street Business Association is one of the city\u2019s official business improvement districts (BIDs), and it stretches along Fourth Street between Temple and Hermosa avenues. For a directory of businesses or more information about the association, visit 4thStreetLongBeach.com or contact us at 4thStreetLongBeach@gmail.com. And, follow us on Instagram, Facebook and Twitter.", "url": "https://www.laweekly.com/event/4th-fridays-on-4th-street-8116811", "orgName": null, "ticket_info": [], "id": "LAweekly_6c83c7c35fa9873c02751fa7798c4ef8"}
{"date_startDate": "2018-11-24", "date_endDate": "2019-02-23", "time_startTime": "20:30:00", "time_endTime": "22:30:00", "location_address": "366 N. La Cienega Blvd.", "location_city": "Los Angeles", "location_name": "Largo at the Coronet", "title": "The Black Version", "description": "\"The Black Version is a completely improvised show that was created and performed to all sold out houses at The Groundlings Theatre starting in 2010. Rolling Stone Magazine calls the show \"Hot\" and the cast \"A Comedic A Team\", LA Weekly says it's \" Red Hot\" and \"Scores more than it's share of Belly Laughs\" and the LA Times calls the show \"A Winner\"!\n\nThe all African American cast of regulars includes show creator Jordan Black along with other comedy veterans Cedric Yarbrough, Gary Anthony Williams, Daniele Gaither, and Phil LaMarr all under the direction of Karen Maruyama. Past special guest performers include Keegan-Michael Key and Jordan Peele of Key & Peele (former original cast members) along with special guest performers such as Wayne Brady, Niecey Nash, Nyima Funk, Jerry Minor and Angela V. Shelton among others who come and perform in the show from time to time.\n\nAlong with the Groundlings Theater The Black Version has performed in San Francisco at the SketchFest comedy festival as well as the Louisville Improv Festival.\n\nThis talented cast has vast film and television credits ranging from Mad TV and Saturday Night Live to the Boondocks and Reno 911 and dozens more.\n\nThe show begins when the director asks the audience to suggest a popular film title and then the cast, right there on the spot, improvise the \u201cblack version\u201d of that film.", "url": "https://www.laweekly.com/event/the-black-version-6821270", "orgName": null, "ticket_info": [{"lowestPrice": "30"}, {"highestPrice": "30"}], "id": "LAweekly_ac6a6227cfb9fbd7d75e8a1c3effd638"}
{"date_startDate": "2018-11-24", "date_endDate": "2019-02-23", "time_startTime": "10:00:00", "time_endTime": "13:00:00", "location_address": "14108 S Western Ave", "location_city": "Gardena", "location_name": "Detail Garage", "title": "Chemical Guys Rides and Coffee", "description": "Rides & Coffee at Detail Garage and Chemical Guys is taking place in beautiful, sunny Gardena, California. This indoor and outdoor gathering will have the best builds from Los Angeles and beyond. \n\nEvent will be filled with:\n\n- Product Giveaways and Raffles\n- A Free DIY Class Tech Session\n- Exclusive discounts for attendees\n- Coffee and Donuts\n\nWe will be Raffleing over $1,000 Dollars in products. \n----- Raffle Tickets are $1 per ticket or $20 for a wrap around a model ;)\n\nRoll in Time:\n9am is roll in time for premium parking spots.\n10am event begins with great music and great people that share your passion.\n12:00pm will be raffle time.\nRoll Out time 1pm\n\nWe will be hosting Cars and Coffee every last Saturday of the month.", "url": "https://www.laweekly.com/event/chemical-guys-rides-and-coffee-8282677", "orgName": null, "ticket_info": [], "id": "LAweekly_4560451c58f9467dfdb606f8d54d555f"}
{"date_startDate": "2018-11-24", "date_endDate": "2019-02-23", "time_startTime": "22:00:00", "time_endTime": "23:00:00", "location_address": "2106 Hyperion Ave.", "location_city": "Los Angeles", "location_name": "Lyric-Hyperion Theater & Cafe", "title": "Deep Squeeze", "description": "Wet the Hippo Collective brings you . . .  DEEP SQUEEZE!\n\nIf you like The Murge, Wet the Hippo, or The Simple Simples, then get ready to fall in love with this group of nut jobs--thirteen people so eager to please the audience they're probably peeing their pants as we speak. These idiots are a ray of hope in the long dark hell spiral that is your life. Is that a tear in your eye from the beauty you're witnessing? No, it's likely spit because one of them is trying to fit their foot in their mouth for your enjoyment. It's going to be wilder than the wild west in there. We'll reach for a more beautiful world, you'll find out what true art is, you'll see improvised movement so majestic you'll wonder if you're in Heaven...you'll even see our coco hurt. One hour locked in a room with people not quite in their right minds, but we wouldn't have it any other way!\n\nDonation-based show with beer, wine, and food available in the lobby.", "url": "https://www.laweekly.com/event/deep-squeeze-7285265", "orgName": null, "ticket_info": [{"lowestPrice": "0"}, {"highestPrice": "0"}], "id": "LAweekly_c5fa235ce60bc3ba4b92faf0643b417d"}
