{"date_startDate": "2018-11-24", "date_endDate": "2019-02-23", "time_startTime": "00:00:00", "time_endTime": "16:00:00", "location_address": "1512 S. Robertson Blvd.", "location_city": "Los Angeles", "location_name": "Institute of Cultural Inquiry", "title": "Wikipedia Meet-up at the ICI", "description": "If you\u2019ve ever complained about sloppy scholarship on Wikipedia or worse yet, you\u2019ve been shocked to learn that some important artist or scholar is missing from its pages, this series of regular events is an opportunity to remedy that problem \u2014 an afternoon of Wikipedia editing with technical assistance, help and assorted tutorials from our resident geek and frequent Wiki page editor, ICI Associate Antoinette LaFarge.\n\nParticipants encouraged to bring their own laptops and chargers but limited extra computers are available. Everyone will have access to the internet through our network as well as to our 3,000+ volume library and the minds and experience of everyone in the room \u2013 that\u2019s the beauty of editing en masse. Drinks and light snacks will be provided. Beginners and walk-ins are welcome. Come for as little as an hour or come for the whole afternoon.", "url": "https://www.laweekly.com/event/wikipedia-meet-up-at-the-ici-6895611", "orgName": null, "ticket_info": [], "id": "LAweekly_dd9b22cbd5444c0ccacea43b4fe4d795"}
