{"date_startDate": "2018-11-20", "date_endDate": "2018-12-15", "time_startTime": "10:00:00", "time_endTime": "17:00:00", "location_address": "5500 University Parkway", "location_city": "San Bernardino", "location_name": "Robert and Frances Fullerton Museum of Art", "title": "MexiCali Biennial", "description": "By\n                \n                    Shana Nys Dambrot                \n\n                                    Since 2006, the organizers of the trans-national curatorial project series MexiCali Biennial have staged interdisciplinary exhibitions and actions on both sides of the border and across the city and county of Los Angeles. Following an installation at LACE in Hollywood over the summer, the next iteration brings the exhibition \"Reclaiming Myth\" to the campus galleries of Cal State University in San Bernardino. The exhibition, organized by Ed Gomez, takes as its muse and inspiration the myth of Calafia, a dark-skinned warrior queen who protected the \"island of California\" and lent the region both her name and her spirit of independence. Not only her image but the historical and cultural legacy of her story form the basis for a politically and conceptually charged perspective on the current social realities of our home.", "url": "https://www.laweekly.com/event/mexicali-biennial-9909516", "orgName": null, "ticket_info": [{"lowestPrice": "0"}, {"highestPrice": "0"}], "id": "LAweekly_a49b9ada01076d046325ad5686887fe9"}
