{"date_startDate": "2018-11-21", "date_endDate": "2018-12-16", "time_startTime": "00:00:00", "time_endTime": "20:00:00", "location_address": "333 S. La Cienega Blvd.", "location_city": "Los Angeles", "location_name": "333 S. La Cienega Blvd.", "title": "Beautycon POP", "description": "Beautycon is an annual makeup lover's wonderland, filling the main floor of the L.A. Convention Center with colorful activations, giveaways and promotions, driven by makeup trends and brand-focused fun. It always sells out, and its success has spawned a second event going down for a full month (Nov. 16-Dec. 16). This year, for the first time, the event expands to a more immersive, retail-style experience with Beautycon POP. Featuring eight gallery-like environments, all with different themes and partnerships behind them (including Laneige's Dream State, Lime Crime's Inner Goddess and the Confidence Runway from Macy's). The experiential, selfie-ready pop-up aims to be a social media\u2013driven hub for pictures, posing, products and, of course, purchasing.", "url": "https://www.laweekly.com/event/beautycon-pop-10064488", "orgName": null, "ticket_info": [{"lowestPrice": "45"}, {"highestPrice": "45"}], "id": "LAweekly_a179ec8de92dfaaa1fa7de3597d83f0e"}
