{"date_startDate": "2018-11-20", "date_endDate": "2018-12-23", "time_startTime": "11:00:00", "time_endTime": "18:00:00", "location_address": "833 E 3rd Street", "location_city": "Los Angeles", "location_name": "Over The Influence", "title": "Invader", "description": "By\n                \n                    Shana Nys Dambrot                \n\n                                    The artist known as Invader (b. Paris, 1965) has placed his signature mosaic-tiled street art installations on walls, bridges, signs, buildings, fences and more all over the world and here in L.A. But for his first gallery show in town since 1995, Invader uses his indoor voice and transfers his vision, as the show title suggests, \"Into the White Cube.\" His quirky yet refined characters, depicting and riffing on retro arcade game pixel personas, are gently subversive gestures in the architectural jungle. Inside gallery walls, they transform into postminimalist studies in line and color, without losing any of their cheeky charm. \"Into the White Cube\" will survey some favorite works made over the last 20 years, alongside new work and experimental forays into other mediums and formats. Unofficially, be on the lookout for new works popping up around the Arts District and beyond in the lead-up to the opening. Invaders gotta invade.", "url": "https://www.laweekly.com/event/invader-10064128", "orgName": null, "ticket_info": [{"lowestPrice": "0"}, {"highestPrice": "0"}], "id": "LAweekly_365c5a7cd7eccead91d1deb3012b18d2"}
{"date_startDate": "2018-12-01", "date_endDate": "2018-12-02", "time_startTime": "None", "time_endTime": "None", "location_address": "3300 Wilshire Blvd.", "location_city": "Los Angeles", "location_name": "Immanuel Presbyterian Church", "title": "Silver and Gold: The Best of our 25 Years", "description": "Fresh off their golden buzzer appearance on America's Got Talent, the 170 voices of Angel City Chorale present some of their most beloved holiday songs from the last 25 years. You'll enjoy traditional holiday favorites including Have Yourself a Merry Little Christmas, Do You Hear What I Hear and more, wrapped in stunning arrangements with festive orchestral accompaniment. And, from classical Christmas (Alleluia Venite and Dadme Albricias) to contemporary pop (Sara Bareilles, Love is Christmas) to R&B Gospel (Joyful Joyful), there is sure to be something for everyone.  Plus, the evening will feature songs for Hanukkah, including One, composed by founder and artistic director Sue Fink.\nGet swept up in the spirit of the season with the thrilling vocal power and dynamic diversity of LA's most exciting choral ensemble and see why Simon Cowell, after hearing ACC, said: \"If this is heaven, I'm happy, because this is what it felt like.\"", "url": "https://www.laweekly.com/event/silver-and-gold-the-best-of-our-25-years-9981965", "orgName": null, "ticket_info": [{"lowestPrice": "40"}, {"highestPrice": "40"}], "id": "LAweekly_0ca970c8dbf088348d03cec8cad1e01a"}
{"date_startDate": "2018-12-04", "date_endDate": "2018-12-04", "time_startTime": "None", "time_endTime": "None", "location_address": "1151 Oxford Rd.", "location_city": "San Marino", "location_name": "Huntington Library, Art Collections and Botanical Gardens", "title": "Camerata Pacifica", "description": "Violinists Kristin Lee and Jason Uyeyama, violist Richard O'Neill and cellist Ani Aznavoorian assemble string quartets by Arensky and Beethoven before doubling in size with the Calder Quartet for Felix Mendelssohn's Octet in E-flat major, Op. 20.", "url": "https://www.laweekly.com/event/camerata-pacifica-9908189", "orgName": null, "ticket_info": [{"lowestPrice": "58"}, {"highestPrice": "58"}], "id": "LAweekly_e20675f0740f9580c4540295ce30b9f8"}
{"date_startDate": "2018-11-20", "date_endDate": "2018-12-12", "time_startTime": "10:00:00", "time_endTime": "20:00:00", "location_address": "6801 Hollywood Boulevard, 2nd Floor", "location_city": "Los Angeles", "location_name": "Japan House LA", "title": "Sou Fujimoto", "description": "Japan House L.A.'s public arts programming continues apace with a new exhibition of images and sculptural models from celebrated architect Sou Fujimoto. Winner of the prestigious 2013 Serpentine Pavilion commission in the U.K. and named 2014 WSJ architecture innovator of the year, Fujimoto's practice is based geographically and culturally in his native Japan, but its innovations, creative material and cultural influence are felt globally. Of special interest to local architecture aficionados will be his stated aesthetic of the \"primitive future\" \u2014 a vision that melds cutting-edge materials and sustainable practices with an intuitive humanistic relationship to nature and outdoor space, especially in the urban context.", "url": "https://www.laweekly.com/event/sou-fujimoto-10000920", "orgName": null, "ticket_info": [{"lowestPrice": "0"}, {"highestPrice": "0"}], "id": "LAweekly_66f53b0e6642b61752ec3f74e782d38d"}
{"date_startDate": "2018-11-20", "date_endDate": "2018-12-31", "time_startTime": "None", "time_endTime": "None", "location_address": "845 N. Alameda St.", "location_city": "Los Angeles", "location_name": "Olvera Street", "title": "Amazing Scavenger Hunt Adventure- Los Angeles", "description": "Turn Los Angeles into a giant game board with this fun scavenger hunt adventure.  Combine the excitement of the Amazing Race with a three-hour city tour.  Guided from any smart phone, teams make their way among well known and overlooked gems of the city, solving clues and completing challenges while learning local history.  \n\nDiscover the hidden secrets of LA as you explore the city solving riddles and having a blast with friends.\n\nAvailable 365 days a year, sunrise to sunset.  Start when you want and play at your pace.  Save 20%- Only $39.20 for a team of 2-5 people after Promotion Code: LAWEEKLY.  Sign up online at www.UrbanAdventureQuest.com.", "url": "https://www.laweekly.com/event/amazing-scavenger-hunt-adventure-los-angeles-8018235", "orgName": null, "ticket_info": [{"lowestPrice": "39"}, {"highestPrice": "5"}], "id": "LAweekly_a950254b43788cec4eee76d0ce887b60"}
{"date_startDate": "2018-12-02", "date_endDate": "2018-12-02", "time_startTime": "None", "time_endTime": "None", "location_address": "8585 Santa Paula Ojai Rd", "location_city": "Ojai", "location_name": "Logan House in Upper Ojai", "title": "Chamber On The Mountain presents the Amerigo Trio & Bernadene Blaha, Pianist", "description": "Chamber On The Mountain is pleased to present the Amerigo Trio (Glenn Dicterow, violin, Karen Dreyfus, viola, and Inbal Segev, cello) & Bernadene Blaha, Pianist on Sunday, December 2, 2018.  \n\n\nProgram:  Beethoven's String Trio in E-flat Major, Op. 3, and Brahms' Piano Quartet No. 1 in G minor, Op. 25.\n\nAudience members are invited to stay and meet the artists at a reception immediately following the performance.  Stay and enjoy refreshments on our patio while taking in a magnificent view of Topa Topa Mountain.", "url": "https://www.laweekly.com/event/chamber-on-the-mountain-presents-the-amerigo-trio-and-bernadene-blaha-pianist-10067209", "orgName": null, "ticket_info": [{"lowestPrice": "25"}, {"highestPrice": "25"}], "id": "LAweekly_0570376927dfe24bd43d30fa77ff84b6"}
