{"date_startDate": "2018-11-29", "date_endDate": "2018-12-02", "time_startTime": "18:00:00", "time_endTime": "21:00:00", "location_address": "3801 Mission Inn Ave.", "location_city": "Riverside", "location_name": "Fox Performing Arts Center", "title": "La Villa de Santa Claus", "description": "Mexico City\u2019s beloved Christmas Classic LA VILLA DE SANTA CLAUS (Santa Claus\u2019s Village), is crossing the border and headed to Southern California this holiday season, for a limited engagement run at the Fox Performing Arts Center (3801 Mission Inn Avenue) in Riverside for one weekend only, November 29 thru December 2. Part Christmas musical and part interactive North Pole experience, LA VILLA DE SANTA CLAUS features a book by Xavier L\u00f3pez Miranda & Magalli Urquieta, music and lyrics by Xavier L\u00f3pez Miranda and Marcial Alejandro & direction by Edgardo Lar. It is presented in Spanish, with subtitles for English Speaking audiences and is executive produced by legendary film and television star Xavier L\u00f3pez \u201cChabelo.\u201d\nHeartwarming and interactive, the production features 10 original songs, a dynamic cast of 26, impressive staging and special effects, a heartwarming interactive play, and the star of the show, the most famous man in a red suit- all of which have made this vibrant family musical a success for over a decade.\n\nAnd the fun doesn\u2019t stop at the theatre! After the show, kids and their parents will wander through Santa\u2019s magical North Pole Village and play with his army of elves, from cottage to cottage as they prepare for the most important delivery of the year! There are a number of activities, puzzles, arts & crafts, physical games, and the chance to meet the man himself, give him your letter and maybe take a selfie!", "url": "https://www.laweekly.com/event/la-villa-de-santa-claus-10064111", "orgName": null, "ticket_info": [{"lowestPrice": "39"}, {"highestPrice": "89"}], "id": "LAweekly_facf655e00bbac45189cdf601d1a667c"}
{"date_startDate": "2018-12-02", "date_endDate": "2018-12-02", "time_startTime": "11:00:00", "time_endTime": "16:00:00", "location_address": "1245 Garfield Ave", "location_city": "Pasadena", "location_name": "Onil Chib\u00e0s Events", "title": "Garfield Heights 12th Landmark District Home Tour", "description": "Celebrating the 19th anniversary of Pasadena\u2019s second oldest\nhistoric district, the Garfield Heights Landmark District tour will feature\nfive beautiful historic homes (built from1895 to 1915) in the Arts and\nCrafts, Victorian, Victorian Cottage and Colonial Revival styles.  These\nhomes were built from; and now they will be open for you to tour and enjoy.\nIncludes:\n\n\n*       Garden Demonstration Project at one of the tour homes with master\ngardener presentations every half hour.\n\n\n*       New vendors and exhibitors, including the Gamble House Book\nStore, American Bungalow Magazine, Sassafrass Pottery and     a GHNA Craft\nBooth.\n\n\n*       Three food trucks featuring a variety of taste-tempting choices.\nPlanned trucks include The Big Cheese (grilled cheese), Belly   Bombz\n(Korean inspired wings and burgers) and Wise Barbeque   (Texas style\nsmokehouse meats).\n\n\n*       Live, roving entertainment by Avo Frandjian and his saxophone, and\nlocal school children.", "url": "https://www.laweekly.com/event/garfield-heights-12th-landmark-district-home-tour-10057910", "orgName": null, "ticket_info": [], "id": "LAweekly_241b986ee586fa52591652d4aa2f6223"}
{"date_startDate": "2018-11-29", "date_endDate": "2018-12-02", "time_startTime": "None", "time_endTime": "None", "location_address": "631 W. Second St.", "location_city": "Los Angeles", "location_name": "REDCAT: Roy & Edna Disney/CalArts Theater", "title": "Prism", "description": "By\n                \n                    Falling James                \n\n                                    A girl named Bibi (portrayed by soprano Anna Schubert) who suffers from a peculiar illness and her mother, Lumee (mezzo-soprano Rebecca Jo Loeb), are shuttered away from the world in a mysterious place called Sanctuary, in librettist Roxie Perkins and composer Ellen Reid's Prism, which receives its world premiere at REDCAT. Co-presented by L.A. Opera's Off Grand series and Beth Morrison Projects, the psychological piece of operatic theater centers on themes of identity, trauma and violence against women as Bibi becomes \"blinded by colors and by memories new and familiar\" as she tries to balance Lumee's worldview with her own search for truth.", "url": "https://www.laweekly.com/event/prism-10076422", "orgName": null, "ticket_info": [], "id": "LAweekly_75e3b2e16c02c5876bb252df6a128f97"}
{"date_startDate": "2018-11-24", "date_endDate": "2018-12-16", "time_startTime": "None", "time_endTime": "None", "location_address": "12700 Center Court Dr.", "location_city": "Cerritos", "location_name": "Cerritos Center for the Performing Arts", "title": "The Nutcracker", "description": "By\n                \n                    Ann Haskins                \n\n                                    For the next six weeks ballet will be blooming across SoCal as that seasonal favorite The Nutcracker arrives. Sugar plum fairies, mice armies, toy soldiers and dancing snowflakes take the stage in dozens of productions ranging from ballet studios to visiting professional companies. First out of the gate and one of the best belongs the Los Angeles Ballet, the city's own professional ballet company. Set in 1913 Los Angeles, LAB's picture-postcard version is also the most accessible since it tours Metro L.A. with performances in Cerritos, Glendale, Redondo Beach, Westwood and Hollywood, with live music by the Los Angeles Ballet Orchestra. Full schedule and tickets at losangelesballet.org. Cerritos Center for the Performing Arts, 18000 Park Plaza Drive, Cerritos; Sat., Nov. 24, 5 p.m.; Sun., Nov. 25, 1 p.m.; $36-$104. Also at Alex Theatre, 216 N. Brand Blvd., Glendale; Sat., Dec. 1, 6 p.m.; Sun., Dec. 2, 2 p.m.; $36-$104. Also at Dolby Theatre, 6801 Hollywood Blvd., Hollywood; Sat., Dec. 8, 1 & 5 p.m.; Sun., Dec. 9, 1 p.m.; $46-$124. Also at Redondo Beach Performing Arts Center, 1935 Manhattan Beach Blvd., Redondo Beach; Sat., Dec. 15, 1 & 5 p.m.; Sun., Dec. 16, 1 p.m.; $36-$104. Also at UCLA Royce Hall, 10745 Dickson Court, Westwood; Sat.-Sun., Dec. 22-23, 1 & 5 p.m.; Mon., Dec. 24, 11 a.m. & 3 p.m.; $36-$124.", "url": "https://www.laweekly.com/event/the-nutcracker-10076409", "orgName": null, "ticket_info": [], "id": "LAweekly_8017b34deb475ffe1a832d7eb0e6a010"}
