{"date_startDate": "2018-11-23", "date_endDate": "2018-12-16", "time_startTime": "None", "time_endTime": "None", "location_address": "11020 W. Magnolia Blvd", "location_city": "N. Hollywood", "location_name": "Cupcake Theater", "title": "Avenue Q", "description": "By\n                \n                    Lina Lecaro                \n\n                                    A play starring puppets in a space called Cupcake might suggest some good clean family fun, but don't get it twisted, this ain't no Bob Baker's Marionette Theater production. The Broadway hit Avenue Q, featuring felt creatures in an uproarious musical about young adults trying to make it in New York City, is like Sesame Street meets Friends, if Friends were a PG-13 movie. Strong language and adult themes are involved, so this one is not recommended for the kiddies, though it is an all-ages venue (and let's face it, youngsters hear worse on the playground). Running since the top of the month, the Tony Award\u2013winning musical has been a smash for the Valley venue with a cast of locals taking on the music and lyrics of Robert Lopez and Jeff Marx \u2014 who initially conceived Avenue Q as a television series, then developed it for the stage in 2002. Sassy and sardonic numbers like \"Everyone's a Little Bit Racist\" delve into topical issues but somehow manage not to come off gratuitous \u2014 unlike that recent Melissa McCarthy movie! Avenue Q is, in fact, warmly nuanced and, ironically, a hilarious and honest show about humanity.", "url": "https://www.laweekly.com/event/avenue-q-10076403", "orgName": null, "ticket_info": [{"lowestPrice": "39"}, {"highestPrice": "79"}], "id": "LAweekly_cc116d54a761ce3ce62c1d11d95c27c5"}
