{"date_startDate": "2018-12-05", "date_endDate": "2018-12-05", "time_startTime": "None", "time_endTime": "None", "location_address": "618 S. Spring St.", "location_city": "Los Angeles", "location_name": "Exchange L.A.", "title": "Golden Child", "description": "Golden Child is a show about reconciliation. It paints a powerful picture of what the world would look like when people come together and celebrate their diversity.  In the story, a young child is transported into a make- believe world, where she encounters the adult version of herself amongst a group of colorful characters. As dark forces attempt to divide and destroy the community, her new friends are faced with the challenge to overcome hatred and oppression with the power of love. Forming a unique union of sight and sound, Golden Child is a cirque-styled ballet concert that will take you on an exhilarating musical journey. By the end, you will understand that the colors of humanity are more beautiful when they come together.\n\nAll ticket sales will be donated to the GO Campaign to serve underprivileged youth in Los Angeles.", "url": "https://www.laweekly.com/event/golden-child-10067211", "orgName": null, "ticket_info": [{"lowestPrice": "40"}, {"highestPrice": "40"}], "id": "LAweekly_65019c28b792ccdf86cd64f81bad44da"}
