{"date_startDate": "2018-11-21", "date_endDate": "2018-12-22", "time_startTime": "00:00:00", "time_endTime": "15:00:00", "location_address": "3126 Beverly Blvd.", "location_city": "Los Angeles", "location_name": "Gabba Gallery", "title": "Wishlist", "description": "By\n                \n                    Shana Nys Dambrot                \n\n                                    Gabba Gallery group shows are reliably lively affairs, with a rotating roster of thematic group and featured-artist selections that spread across all mediums but are always tethered to an explosive and edgy street art aesthetic. But this time of year the theme gets pretty straightforward: Buy art. For the sixth installment of Wishlist, Jason Ostro and Elena Jacobson curate the works of more than 100 artists, with nothing priced over $1,000, available on a cash-and-carry basis. The idea is to extend their inclusive cultural ideas to encourage not only collectors to treat themselves but, as the holidays fast approach, to inspire anyone and everyone to give the gift of art as well. They take care of last-minute art Santas, too, as the exhibition, presumably with sold works periodically replaced, is open through Dec. 22.", "url": "https://www.laweekly.com/event/wishlist-10064134", "orgName": null, "ticket_info": [{"lowestPrice": "0"}, {"highestPrice": "0"}], "id": "LAweekly_8f914569711915a8fdde3bcbe91613a7"}
{"date_startDate": "2018-12-05", "date_endDate": "2018-12-05", "time_startTime": "None", "time_endTime": "None", "location_address": "610 E. California Ave.", "location_city": "Glendale", "location_name": "Glendale City Seventh-Day Adventist Church", "title": "Jacqueline Suzuki & Brendan White", "description": "Violinist Suzuki and pianist White sift through sonatas and fantasies by French composers Faur\u00e9, Messiaen and Debussy.", "url": "https://www.laweekly.com/event/jacqueline-suzuki-and-brendan-white-10076418", "orgName": null, "ticket_info": [{"lowestPrice": "0"}, {"highestPrice": "0"}], "id": "LAweekly_480b048545eeb90b738947a5dc890eb9"}
{"date_startDate": "2018-11-20", "date_endDate": "2018-12-01", "time_startTime": "11:00:00", "time_endTime": "18:00:00", "location_address": "300 S Mission Rd", "location_city": "Los Angeles", "location_name": "Maccarone", "title": "Jim Carrey", "description": "By\n                \n                    Shana Nys Dambrot                \n\n                                    Actor and secretly deadly serious court jester to the world, Jim Carrey also has taken up a practice in visual art in recent years. His giant and well-stocked painting studio is the envy of oil-and-canvas lovers everywhere, but it's been his work as a political cartoonist that has truly caught fire and revealed the best part of his newfound skills to a global audience of adoring Instagram fans. Carrey brings the same full-on intensity, fearless dark comedy, gift for mimicry and knack for emphatic satire from his performances to his pen and paper, creating haunting, hilarious, supremely funny and utterly unsettling editorial pictures. The many works on display in \"IndigNation\" at tony Eastside gallery Maccarone have been made in the last two years, and are timed to be on view through the upcoming midterm elections (Nov. 6! Register!). Spoiler alert: Carrey isn't exactly 45's biggest fan.", "url": "https://www.laweekly.com/event/jim-carrey-9944358", "orgName": null, "ticket_info": [{"lowestPrice": "0"}, {"highestPrice": "0"}], "id": "LAweekly_7a83ab52d56c285b107d2187050fb030"}
