{"date_startDate": "2018-12-01", "date_endDate": "2018-12-01", "time_startTime": "None", "time_endTime": "None", "location_address": "698 Vermont Ave", "location_city": "Los Angeles", "location_name": "Alchemist Coffee Project", "title": "KTown Walking Tour: Wilshire Blvd(Immanual Church/Chapman Plaza)", "description": "This time we will meet at an excellent coffee shop in K-town, the cute Alchemist Coffee Project at 10am, do a quick intro and start exploring this area. The Korean consulate, the historical Immanual Church, and the famous Talmadge Apartments are all close to each other in that area. We will explore this area and look at the architecture and history. Then we will look at a few places as we head towards Chapman Plaza, another beautiful historical building, on 6th which is about 0.3 miles away. Then we will explore the area and look at some stores and restaurants and finish by eating some delicious food together!", "url": "https://www.laweekly.com/event/ktown-walking-tour-wilshire-blvd-immanual-church-chapman-plaza-10076791", "orgName": null, "ticket_info": [], "id": "LAweekly_3d68873cbf63d1d6da6f929d135ef178"}
