{"date_startDate": "2018-12-01", "date_endDate": "2018-12-01", "time_startTime": "None", "time_endTime": "None", "location_address": "621 S. Western Ave", "location_city": "Los Angeles", "location_name": "MaDang Courtyard", "title": "Korea Town Walking Tour: Western Ave./Madang Plaza", "description": "Join us for a fun immersive walking tour exploring various interesting sites and sounds on Western Ave. in Korea Town. We start at Madang Courtyard Plaza, where we will try some free food samples of Korean street food, baked goods, and other bites. We will check out different hidden stores and markets on Western Ave and visit the sesame/perilla oil pressing store. We will learn about Korean food and eat together at an excellent Korean restaurant.", "url": "https://www.laweekly.com/event/korea-town-walking-tour-western-ave-madang-plaza-10076788", "orgName": null, "ticket_info": [{"lowestPrice": "0"}, {"highestPrice": "0"}], "id": "LAweekly_c5493e96ece7ccef24960c5af06cb1c1"}
