{"date_startDate": "2018-11-23", "date_endDate": "2018-12-22", "time_startTime": "17:00:00", "time_endTime": "20:00:00", "location_address": "N. Rodeo Drive", "location_city": "Beverly Hills", "location_name": "Beverly Hills Holiday Lighting Celebration", "title": "Ongoing BOLD Holiday Programming", "description": "BOLD Holidays is taking over Rodeo Drive with magical, festive and elevated programming that you won\u2019t want to miss.  Immerse yourself in the holiday magic taking place on Rodeo Drive every Friday and Saturday between November 16th - December 22nd from 5-8pm. Step into a world where floral takeovers are on every corner, monogramming booths leave you with a personalized take-home memory, nighttime shopping becomes an evening event, and live painting performances bring art to the forefront on the iconic street. These are just a few of the surprises Rodeo Drive has in store this summer.\n\nDon\u2019t miss out on these experiential activations happening #OnlyOnRodeo and make sure to use #BOLDBH when posting!", "url": "https://www.laweekly.com/event/ongoing-bold-holiday-programming-10036415", "orgName": null, "ticket_info": [{"lowestPrice": "0"}, {"highestPrice": "0"}], "id": "LAweekly_00a288fa4c670e3ee6e1b794065dfa88"}
{"date_startDate": "2018-12-01", "date_endDate": "2018-12-01", "time_startTime": "19:00:00", "time_endTime": "23:00:00", "location_address": "1162 Glendale Blvd.", "location_city": "Los Angeles", "location_name": "One One Six Two", "title": "Light of the world", "description": "LA Loves Los Angeles based  humanitarian/artist organization and Echo Park Gallery One One Six Two are pleased to announce \"Light of the world\u201d  a photo series about journeying back to the motherland and showing the strength of Africa.\n\n\nThis debut show gives us a look at a body of work by humanitarian photographer Letticia Bissondut and sees her fall in love with her subjects while follow them in their everyday life. Letticia dances with her camera creating movement, light and life in every frame. The purpose of \"Light of the world\u201d is to show that we are far more alike than we are different. Poverty and child labor are addressed as social challenges, but the strength of the Malawian people is above all else.", "url": "https://www.laweekly.com/event/light-of-the-world-10054972", "orgName": null, "ticket_info": [{"lowestPrice": "0"}, {"highestPrice": "0"}], "id": "LAweekly_4d5ffe9afbc8716ea98d1b7167d77015"}
{"date_startDate": "2018-12-01", "date_endDate": "2018-12-29", "time_startTime": "16:00:00", "time_endTime": "19:00:00", "location_address": "681 Venice Blvd.", "location_city": "Venice", "location_name": "Beyond Baroque Literary Arts Center", "title": "\"Ain't My First Rodeo: The Show\" by Jim Storm, photographer", "description": "Opening Reception with Jim Storm  December 1st, 2018  4-7 pm \n\n\nPhotographs will continue to be on Display December 2nd thru 30th \nFridays and Saturdays 3-10- pm\nSunday times varies - visit beyondbaroque.org for more information\n\n\nA theatrical photographic retrospective of \"Ain't My First Rodeo:  The Show\"  by actor/photographer Jim Storm, contributing photographer for \"Cultural Weekly\" online global magazine.  A compelling and unique behind the scenes look at the journey of the American Cowboy and the Rodeo through the eye of the camera.  A traveling gypsy spirit whose ultimate glory is determined by eight seconds...and it's not about the money.", "url": "https://www.laweekly.com/event/aint-my-first-rodeo-the-show-by-jim-storm-photographer-10052751", "orgName": null, "ticket_info": [{"lowestPrice": "0"}, {"highestPrice": "0"}], "id": "LAweekly_601d33d1e8e3d33d3f0c25b5471efe14"}
