{"date_startDate": "2018-12-05", "date_endDate": "2018-12-05", "time_startTime": "None", "time_endTime": "None", "location_address": "1735 Vine St.", "location_city": "Los Angeles", "location_name": "Avalon Hollywood", "title": "Between Two Worlds: The Moth Mainstage in LA", "description": "KCRW is bringing the Moth\u2019s festive celebration of inspiring, harrowing, and courageous storytellers back to LA. Hand-picked Moth Mainstage all-stars will tie together the brilliant and the absurd for a spellbinding evening at the historic Avalon Hollywood. Since each story is true and every voice authentic, the show dances between documentary and theater, creating a unique, intimate, and often enlightening experience for the audience.\n\nSeating is general admission by section, so be sure to arrive on time and find your favorite seat!\n\nAfter Party: Top level ticket holders get access to the official after-party at Bardot. Sip complimentary beer and wine, meet The Moth storytellers, and enjoy live music spun by KCRW DJ Jos\u00e9 Galv\u00e1n!\n\nPlease note: This event is 21+. Any ticket holder unable to present a valid ID will not be admitted to this event and will not be eligible for a refund.", "url": "https://www.laweekly.com/event/between-two-worlds-the-moth-mainstage-in-la-10064141", "orgName": null, "ticket_info": [{"lowestPrice": "39"}, {"highestPrice": "79"}], "id": "LAweekly_bf6d64893713034b2788e7ff752e9bf0"}
{"date_startDate": "2018-12-05", "date_endDate": "2018-12-05", "time_startTime": "None", "time_endTime": "None", "location_address": "801 E. Fourth Place", "location_city": "Los Angeles", "location_name": "Art Share L.A.", "title": "TRADING STORMS\u2014Music and Poetry by Mary Lou Newmark and Brendan Constantine", "description": "Electric violinist Mary Lou Newmark and Poet Brendan Constantine present an encore performance of their signature blend of original music and poetry.  In \u201cTrading Storms,\u201d Mary Lou and Brendan perform their own compositions as well as several new works in collaboration.\n\n\nMary Lou is truly an original voice as a composer and a performer on the five-string electric violin.  Her music moves across genres to encounter wild birds, coyotes, beats, poetic verse, and noisy toys.\n\n\nBrendan is one of Southern California\u2019s most recognized poets.  His work has appeared in many of the nation\u2019s literary standards including the Best American Poetry 2018 and Poem-a-Day. \n\n\nMary Lou\u2019s latest CD is \u201cRoom to Breathe\u201d (2017) from Green Angel Music.  Brendan\u2019s latest poetry collection is \u201cDementia, My Darling\u201d (2016) available from Red Hen Press.", "url": "https://www.laweekly.com/event/trading-storms-music-and-poetry-by-mary-lou-newmark-and-brendan-constantine-10036028", "orgName": null, "ticket_info": [{"lowestPrice": "10"}, {"highestPrice": "10"}], "id": "LAweekly_06781d66453c05c59f4e63ec4b574dbd"}
