{"date_startDate": "2018-12-08", "date_endDate": "2018-12-08", "time_startTime": "None", "time_endTime": "None", "location_address": "928 S. Western Ave", "location_city": "Los Angeles", "location_name": "Korea Town Plaza Market", "title": "KTown Walking Tour: Tale of 2 Plazas", "description": "Has anyone been confused by the 2 shopping plazas that stand next to each other close to Western Ave. and Olympic Blvd? - The Korea Town Plaza and The Korea Town Galleria. I certainly have gone to the wrong one when I first started going there years ago and been frustrated when I couldn't find the place I thought for sure was in one or the other plazas. Let's explore the different shops, markets, and food courts in these two shopping centers.", "url": "https://www.laweekly.com/event/ktown-walking-tour-tale-of-2-plazas-10076795", "orgName": null, "ticket_info": [{"lowestPrice": "0"}, {"highestPrice": "0"}], "id": "LAweekly_bbd364bb31329efc17f85cb760624e1b"}
