{"date_startDate": "2018-12-07", "date_endDate": "2018-12-08", "time_startTime": "14:00:00", "time_endTime": "02:00:00", "location_address": "2234 W Temple Street", "location_city": "Los Angeles", "location_name": "DAF Creative Studios", "title": "Rotten Santa: The South Pole Experience", "description": "The South Pole Experience is an immersive holiday comedy pop-up event and Santa photo experience like you\u2019ve never seen before! Be the envy of your friends and family by traveling to this magical wintry South Pole setting in the heart of Los Angeles where you\u2019ll meet Rotten Santa and his hilarious neighbors. Launching in Echo Park, Los Angeles this December 7th & 8th, this epic signature pop-up event kicks off a series that is sure to usher in a new alternative tradition. Guests will take their holiday photos with Rotten Santa, enjoy a live comedy show, and take part in a meet and greet with the witty and sarcastic South Pole cast. Tasty holiday drinks will be available. There will be plenty of Instagrammable moments to have your long-distance friends feeling hardcore FOMO if they miss out on this extraordinary moment.", "url": "https://www.laweekly.com/event/rotten-santa-the-south-pole-experience-10045387", "orgName": null, "ticket_info": [{"lowestPrice": "15"}, {"highestPrice": "15"}], "id": "LAweekly_695219bad1aeba68b97c94453cdff606"}
{"date_startDate": "2018-12-07", "date_endDate": "2018-12-16", "time_startTime": "None", "time_endTime": "None", "location_address": "4934 Lankershim Blvd.", "location_city": "North Hollywood", "location_name": "The Avery Schreiber Playhouse", "title": "Rope, a Play by Patrick Hamilton", "description": "Based on the sensational Leopold and Loeb murder of 1924 and later adapted into Alfred Hitchcock\u2019s classic film, Patrick Hamilton\u2019s Rope paints a macabre yet wickedly humorous portrait of murder as an artform to be enjoyed by superior beings. When young men Wyndham Brandon and Charles Granillo strangle their fellow undergraduate and then throw a party around the chest in which the murdered man resides, viewers are left to wonder if the rule-making elite are indeed superior enough to get away with the perfect crime. \n\n\nAudiences are encouraged to dress in roaring 20\u2019s fashion as they too will be invited to the party and serve as witness to this \u201cmost mysterious and weird\u201d event. Guests will also enjoy live jazz music before and after the show. \n\n\nThe ensemble features a stellar cast, including Raul S. Julia, Brendan Frost, Grant Fletcher Prewitt, Eddie Liu, Shelly Snellman, Jay Akin, John Mawson, and Katie Zeiner, as well as a phenomenal crew. An Art Deco rope inspired set design is by R. Benjamin Warren, with sound design by Mark Holden, owner of The Invisible Studios.\n\n\nFor more information and to buy tickets, please visit www.roboandbash.com/rope", "url": "https://www.laweekly.com/event/rope-a-play-by-patrick-hamilton-10002068", "orgName": null, "ticket_info": [{"lowestPrice": "30"}, {"highestPrice": "30"}], "id": "LAweekly_bdfbab34cd51f38c600752d6ed34a6e3"}
