{"date_startDate": null, "date_endDate": null, "time_startTime": "19:30:00", "time_endTime": "20:30:00", "location_address": "1536 N Highland Ave", "location_city": "Los Angeles", "location_name": "IDA Hollywood", "title": "Red Relev\u00e9 in Hollywood", "description": "RED RELEV\u00c9\nClasses can be purchased online at redreleve.com.  Regular class rate is $20.  Through November 30 only, enter the code HOLLYWOOD at checkout for 50% off sitewide!\n\n\nBallet.  Burlesque.  Booty.\nAbandon your inhibitions in Byron Quiros\u2019 sexy signature workout for women. In this steamy body-positive class, traditional ballet conditioning meets burlesque-based movement to build long and lean muscles and increase flexibility. Set to a hot playlist, Red Relev\u00e9 is an intoxicating booty-shaping, fat-burning dance party that will leave you wanting more.\n\n\nByron developed Red Relev\u00e9 for clients who wanted to move more seductively in studio and in their everyday lives. It has evolved into a sensual, whole-body fitness method that empowers women to move confidently and embrace their inner fire.\n\n\nAll levels welcome. Please bring a mat, a towel, and water. Wardrobe and accessories that help you embrace the sensual nature of the class are encouraged, but not required.\n\n\nByron Quiros has worked as a professional dancer and choreographer for more than 25 years. Born and raised in Southern California, Byron learned Latin dance from his Costa Rican mother at a young age. Growing up he enjoyed the freedom and expression of hip hop and breakdance. In college, Byron discovered classical ballet and quickly realized the physical benefits of balletic training: longer, leaner muscles; improved posture and flexibility; and increased core strength. This training has influenced his work as a dancer, choreographer, trainer and instructor. Byron has appeared in several stage productions, music videos, television shows, and films.", "url": "https://www.laweekly.com/event/red-releve-in-hollywood-10036009", "orgName": null, "ticket_info": [{"lowestPrice": "20"}, {"highestPrice": "20"}], "id": "LAweekly_1a7e9604c682ae9b5d5794b1c6b6f0c4"}
