{"date_startDate": "2018-11-20", "date_endDate": "2018-11-20", "time_startTime": "None", "time_endTime": "None", "location_address": "2200 Beverly Blvd.", "location_city": "Los Angeles", "location_name": "Bootleg Theater", "title": "Pearl Charles, Tim Hill, Parting Lines", "description": "By\n                \n                    Falling James                \n\n                                    Pearl Charles is a country-rock diva for a brave new era. The songs from the L.A. singer\u2019s two full-length albums \u2014 her 2015 self-titled debut and 2018\u2019s Sleepless Dreamer \u2014 encompass psychedelic pop, garage rock and folk as well as more straightforward country-rock leanings. Throughout it all, her melodious vocals are layered over her music with a honeyed, rueful grace. \u201cAll the Boys\u201d is a jangling power-pop reverie, whereas \u201cBeginner\u2019s Luck\u201d is a more soulful pop confessional. The title track of Sleepless Dreamer is a restless, aptly titled escape, while \u201cOnly in America\u201d is an evocative, countrified state-of-the-union address in which Charles gently, reassuringly finds the connections between battling strangers. One of her key songs remains the timelessly compelling romantic urgency of the sparkling garage-rock anthem \u201cYou Can Change,\u201d from her debut record.", "url": "https://www.laweekly.com/event/pearl-charles-tim-hill-parting-lines-10013245", "orgName": null, "ticket_info": [{"lowestPrice": "12"}, {"highestPrice": "12"}], "id": "LAweekly_95b5a4c7943c0a56f600318398e1253f"}
