{"date_startDate": "2018-11-20", "date_endDate": "2018-11-29", "time_startTime": "19:00:00", "time_endTime": "22:00:00", "location_address": "8754 Washington Blvd.", "location_city": "Culver City", "location_name": "Helms Design Center", "title": "L A Y E R S solo exhibition by Liza Philosof", "description": "\"I see my paintings as a visual extension of my emotional journey in life. A reflection of the struggles and challenges we all have. Climbing a mountain or crossing an ocean \nare just metaphors of deep tectonic movement happening in our souls. Nature has endless layers,\n as we have. In paintings, I try to embrace observing nature with an interpretation of what our \ninner world looks like. I feel that one of my secret missions is to continue to see life in color.\"\n\n\nL A Y E R S is the first solo exhibition of Liza Philosof in L.A. \nL A Y E R S contains paintings made by Philosof between the years 2015-2018, \nand a video made last year on art residence that took place at Pico Island (Atlantic ocean). \nOne of the major inspiration sources was the visit to Pico Island and being surrounded by \n3 elements: water, basalt stone, and plants. Some of the paintings were drawn with markers \non canvas and most of the paintings were drawn with acrylics during this summer (2018)\n\n\nLiza Philosof is a visual artist, art director, and graphic designer based in West Hollywood \nand originally from Israel. Philosof is working with designers and artists, she continues to participate \nin exhibitions, festivals, projects, and partnerships all over the world. Brand collaborations included: \nAdidas originals, Absolut, Heineken, Insight, Azores Fringe Festival, and Cannes Film Festival. \nPhilosof graduated with a Bachelor of Arts in Visual Communication from the Bezalel Academy \nof Arts and Design in Jerusalem in 2011, where her color and shape depths experiment began. \nFor more info: lizaphilosof.com | liza.philosof@gmail.com | Eventbrite | Facebook | Instagram\n\n\nSupported by Angela Anthony Helms Bakery District | Fred Makapugay Amphorium | Ashley Frey California Love Water \nSpecial thanks to Alyssa Mannis Littlebite gallery\nAdam Carneol the burgundy", "url": "https://www.laweekly.com/event/l-a-y-e-r-s-solo-exhibition-by-liza-philosof-10056515", "orgName": null, "ticket_info": [], "id": "LAweekly_6dd5ebc389dace9ab7eee010a736c32a"}
{"date_startDate": "2018-11-20", "date_endDate": "2018-11-24", "time_startTime": "10:00:00", "time_endTime": "18:00:00", "location_address": "148 N. La Brea Ave.", "location_city": "Los Angeles", "location_name": "Fahey/Klein Gallery", "title": "The Mash-Up", "description": "By\n                \n                    Shana Nys Dambrot                \n\n                                    A new book and corresponding exhibition answer the question, what happens when one of Britain's most legendary music photographers lets a host of NYC street artists loose on her prints? \"The Mash-Up\" series combines Janette Beckman's wildly popular photographic portraits of some of the most beloved DJs and MCs, such as Slick Rick and Cey Adams, with hand-embellished painting, drawing and collage work by many of the great graffiti artists of our time, including Crash, Futura, Lady Pink, Revolt and Zephyr. The results are exuberant, stylish homages to a confluence of time and place whose cultural megawattage produced superstars that continue to influence art, music and style to this day. Opening-night people-watching is just part of the fun. Following Thursday's opening, there will be an artist talk and book signing with Beckman and project curator Cey Adams (Def Jam) at the gallery on Saturday, Oct. 13, at 2 p.m.", "url": "https://www.laweekly.com/event/the-mash-up-9920492", "orgName": null, "ticket_info": [{"lowestPrice": "0"}, {"highestPrice": "0"}], "id": "LAweekly_47932cda74d400099d86b1673bca2c0a"}
