{"date_startDate": "2018-11-20", "date_endDate": "2018-11-20", "time_startTime": "None", "time_endTime": "None", "location_address": "2701 N. Sepulveda Blvd.", "location_city": "Los Angeles", "location_name": "Skirball Cultural Center", "title": "Sen. Kirsten Gillibrand with Girlgaze founder Amanda de Cadenet", "description": "By\n                \n                    David Cotner                \n\n                                    Just because someone is unaware doesn't mean that they don't want to learn \u2014 and here to teach you all about the people who suffered for women's suffrage, Writers Bloc presents Sen. Kirsten Gillibrand with Girlgaze founder Amanda de Cadenet discussing Gillibrand's children's book, Bold and Brave: 10 Heroes Who Won Women the Right to Vote ($19, Knopf). The 19th Amendment is almost 100 years old, and in this slender volume, Gillibrand tells vivid, vibrant and vital stories of those who made the last century just a little less agonizing and shitty for women in particular and America in general.", "url": "https://www.laweekly.com/event/sen-kirsten-gillibrand-with-girlgaze-founder-amanda-de-cadenet-10064145", "orgName": null, "ticket_info": [{"lowestPrice": "33"}, {"highestPrice": "33"}], "id": "LAweekly_161d881d5f557d592733d5006a1439a5"}
