{"date_startDate": null, "date_endDate": null, "time_startTime": "None", "time_endTime": "None", "location_address": "2200 E. Katella Ave.", "location_city": "Anaheim", "location_name": "City National Grove of Anaheim", "title": "Anaheim Ballet\u2019s \u201cThe Nutcracker\u201d", "description": "The holiday season comes to life in Anaheim Ballet's The Nutcracker, the heartwarming tale of Clara and her Nutcracker Doll who changes her woeful winter into a fanciful feast in Candyland. The Nutcracker ballet is a cornerstone of seasonal family entertainment and tradition. Anaheim Ballet's full-length Nutcracker with Symphony Irvine is the production you and your family must see, a story presented with heart as only AB can present it, more than dance... Experience a spectacle of towering Christmas trees, waltzing flowers, battling toy soldiers and menacing mice. The enduring theme remains unchanged-good overcomes evil-but AB's staging of the family classic is constantly updated, which keeps the production fresh. Anaheim Ballet celebrates its 32nd season of Nutcracker performances featuring staging and choreography by Sarma Lapenieks Rosenberg, Anaheim Ballet\u2019s acclaimed artistic director.", "url": "https://www.laweekly.com/event/anaheim-ballets-the-nutcracker-9990050", "orgName": null, "ticket_info": [], "id": "LAweekly_6611f2ad08ce4eb2a2f60a7dbc491502"}
