{"date_startDate": "2018-11-21", "date_endDate": "2018-11-21", "time_startTime": "None", "time_endTime": "None", "location_address": "929 S. Broadway", "location_city": "Los Angeles", "location_name": "The Theatre at Ace Hotel", "title": "Cat Power", "description": "By\n                \n                    Falling James                \n\n                                    Cat Power has long had one of the most beguiling and soulful voices among modern singer-songwriters. Her specialty is lulling, languorous balladry in which she slows down time and the beating of her heart, reveling in loneliness and sadness with a deliberate, contemplative intensity that\u2019s ultimately cathartic and moving. With her latest album, Wanderer, Power reclaims her own identity as moody soothsayer after reportedly battling with her former label over what her music should sound like. \u201cI took the lead,\u201d she declares on \u201cWoman,\u201d a duet with simpatico ally Lana Del Rey. \u201cYour money\u2019s like a weapon, a tool to get me/You think I\u2019m like the other ones \u2026 Well, my cage is a weapon, it\u2019s perfect for me/It\u2019s the one suit they seem to not see.\u201d She\u2019s even bolder about love and war on the hypnotic idyll \u201cIn Your Face.\u201d", "url": "https://www.laweekly.com/event/cat-power-10053154", "orgName": null, "ticket_info": [{"lowestPrice": "38"}, {"highestPrice": "48"}], "id": "LAweekly_fc8f28d9e0fc8992ef18f4c1dde35734"}
{"date_startDate": "2018-11-21", "date_endDate": "2018-11-21", "time_startTime": "None", "time_endTime": "None", "location_address": "2969 Wilshire Blvd.", "location_city": "Los Angeles", "location_name": "Los Angeles Celebrations Banquet Halls", "title": "TransGiving Party", "description": "If you're trans, Thanksgiving is often more a time of psychological disembowelment than it is a time of unity and celebration. The people behind tonight's TransGiving Party understand your seasonal terrors with a particularly personal level of poignancy, so ignore all those noxious poisoners in your life and come on down to this party made just for you and your true allies. You'll enjoy an evening of entertainment and access to friendly resources, including but not limited to the Center for Health Justice, Los Angeles LGBT Center, the Trans Wellness Center, the Wall Las Memorias Project and Unique Woman's Coalition.", "url": "https://www.laweekly.com/event/transgiving-party-10064362", "orgName": null, "ticket_info": [], "id": "LAweekly_02bb644bf29942d2761a73fcb44c18e5"}
