{"date_startDate": "2018-11-21", "date_endDate": "2018-11-21", "time_startTime": "None", "time_endTime": "None", "location_address": "1234 W. Seventh St.", "location_city": "Los Angeles", "location_name": "The Teragram Ballroom", "title": "The Orb, DF Tram", "description": "By\n                \n                    Brett Callwood                \n\n                                    English electronic music pioneers The Orb have been peddling their chilled, ambient house for a full 30 years at this point. It was in 1991 that they released debut album The Orb\u2019s Adventures Beyond the Ultraworld and the accompanying \u201cLittle Fluffy Clouds\u201d smash hit single. They would then spend the \u201990s being among the most respected and adored electronic acts on the planet. A British festival didn\u2019t feel complete without The Orb on the bill. To the casual observer, it might feel like things dipped a little as the new millennium began, but in fact nothing could be further from the truth. They\u2019ve remained remarkably prolific, right up to this year\u2019s 15th studio album, No Sounds Are Out of Bounds, and the quality has stayed incredibly high. This show should be a treat. DF Tram also plays.", "url": "https://www.laweekly.com/event/the-orb-df-tram-10056541", "orgName": null, "ticket_info": [{"lowestPrice": "35"}, {"highestPrice": "35"}], "id": "LAweekly_65d36ba7125db2499790f5951d5ca02a"}
