{"date_startDate": "2018-11-22", "date_endDate": "2018-11-22", "time_startTime": "None", "time_endTime": "None", "location_address": "618 S. Spring St.", "location_city": "Los Angeles", "location_name": "Exchange L.A.", "title": "Goldie, DJ Hype, Nightstalker, No Face, MC Dino, MC Dre", "description": "By\n                \n                    Brett Callwood                \n\n                                    Especially for Thanksgiving, Bassrush and Respect are making us truly thankful with this awesome drum and bass spectacular featuring DJ Hype, DJ Nightstalker, No Face, MC Dino, MC Dre and, of course, Goldie. The British Metalheadz label founder is one of the pioneers of drum and bass \u2014 one of the guys alongside the likes of Grooverider, Fabio and Roni Size, who took the music out of the underground and into the mainstream consciousness. But Goldie really does reign as king of that particular hill. His 1995 album, Timeless, is a true masterpiece, and last year he released The Journey Man, only his third studio album and his first in nearly two decades. Hey, the man\u2019s been busy with his art and TV work, as well as DJing. It\u2019s great to have him producing new music again, though, and we can\u2019t wait for the L.A. show.", "url": "https://www.laweekly.com/event/goldie-dj-hype-nightstalker-no-face-mc-dino-mc-dre-10053097", "orgName": null, "ticket_info": [{"lowestPrice": "10"}, {"highestPrice": "75"}], "id": "LAweekly_ff7e6edc11909d9b6b679014baa69c00"}
