{"date_startDate": "2018-11-26", "date_endDate": "2018-11-26", "time_startTime": "11:30:00", "time_endTime": "22:00:00", "location_address": "Arcadia", "location_city": "Arcadia", "location_name": "Westfield Mall Santa Anita", "title": "Porkfolio Korean BBQ Grand Opening", "description": "Join us on November 26th from 11:30am to 10:00pm for Porkfolio Korean BBQ's official GRAND OPENING at Westfield Santa Anita Mall!\n\n\nALL Guests dining from November 26 - November 30 receive ONE Signature Kkochi (Skewer) of crispy pork belly with spicy Korean apple sauce\n\n\nFirst 50 guests in line and dine-in will receive these FREE Goodies! (LINE UP EARLY!)\n\n\n1. (1) FREE Porkfolio Tote Bag\n2. (1) FREE Porkfolio t-shirt\n3. (1) FREE Signature Kkochi \u2013 Crispy pork belly / spicy Korean apple sauce\n\n\nFirst 51 to 150 guests in line and dine-in will receive these FREE Goodies!\n\n\n1. (1) FREE Porkfolio Tote Bag\n2. (1) FREE Signature Kkochi \u2013 Crispy pork belly / spicy Korean apple sauce\n\n\nPorkfolio Korean BBQ At A Glance: \n\u00b7 8 Flavors of Pork Belly\n\u00b7 Premium Beef Selections\n\u00b7 Korean Skewered Kkochi Menu\n\u00b7 Crafted Soju & Sake Cocktails\n\n\n*Limit one FREE Skewer per guest\n*Size choice for t-shirts not available\n\n\nAbout Porkfolio Korean BBQ: \nPorkfolio Korean BBQ is a modern, approachable, and refined take on traditional Korean BBQ. As a sister restaurant of Koreatown's E!GHT Korean BBQ, we offer our signature 8 Flavors Pork Belly Combo as well as a half dozen premium beef selections prepared table side. In addition, Porkfolio Korean BBQ's menu showcases an exciting list of banchan, small side dishes, as well as our griddled Korean skewered kkochi menu. We also feature an extensive cocktail menu emphasizes on well-balanced crafted soju and sake cocktails also prepared at your table.", "url": "https://www.laweekly.com/event/porkfolio-korean-bbq-grand-opening-10076780", "orgName": null, "ticket_info": [], "id": "LAweekly_b2e9d0e2d3b50685