{"date_startDate": "2018-11-26", "date_endDate": "2018-11-26", "time_startTime": "10:30:00", "time_endTime": "13:00:00", "location_address": "332 S. Michigan Ave.", "location_city": "Pasadena", "location_name": "Beckman Auditorium, Caltech", "title": "Mars InSight Landing: Viewing Party and Discussion", "description": "By\n                \n                    Falling James                \n\n                                    It's already traveled more than 33 million miles but when NASA's robotic lander InSight touches down on the surface of Mars today, it will draw quite a big crowd of curious fans on this planet. Caltech and the Planetary Society are hosting Mars InSight Landing: Viewing Party and Discussion, with live coverage of the spacecraft's landing beamed from Jet Propulsion Laboratory. The Planetary Society's Mat Kaplan hosts a panel discussion about InSight's mission, which involves checking Mars' temperature and pulse and deploying a seismometer.", "url": "https://www.laweekly.com/event/mars-insight-landing-viewing-party-and-discussion-10076415", "orgName": null, "ticket_info": [{"lowestPrice": "0"}, {"highestPrice": "0"}], "id": "LAweekly_5a316ed451684363134166acd2650eab"}
{"date_startDate": "2018-11-27", "date_endDate": "2018-11-29", "time_startTime": "08:30:00", "time_endTime": "17:00:00", "location_address": "Watt Hall 104 University Park Campus", "location_city": "Los Angeles", "location_name": "USC Helen Lindhurst Fine Arts Gallery", "title": "Intra-Arts Study Break", "description": "By\n                \n                    Shana Nys Dambrot                \n\n                                    The reinvigorated programs at USC's Roski School of Art and Design make for some fascinating experimental interdisciplinary forays. It's the best of archetypal art-school shenanigans but with an expanded field of resources and conspirators that stretches across campus from the painting studio to the dance hall to the film screen. For just four days this week, students from the theater, film, dance and music departments are invited over for an intensive playdate with their friends from the visual arts, culminating in an Intra-Arts Study Break\u2013themed reception with music, snacks, dialogue and eclectic offerings to the fickle, fanciful gods of creative collaboration.", "url": "https://www.laweekly.com/event/intra-arts-study-break-10076417", "orgName": null, "ticket_info": [{"lowestPrice": "0"}, {"highestPrice": "0"}], "id": "LAweekly_03feb3e7b8c91c4188cbb0214885e705"}
{"date_startDate": "2018-11-27", "date_endDate": "2018-11-27", "time_startTime": "21:00:00", "time_endTime": "23:30:00", "location_address": "6925 Hollywood Blvd.", "location_city": "Los Angeles", "location_name": "TCL Chinese Theatre", "title": "Something Wicked This Way Comes", "description": "By\n                \n                    Lina Lecaro                \n\n                                    It's coming our way again. It's the 35th anniversary of the spooky Disney classic Something Wicked This Way Comes and to celebrate, Mad Monster Movie Night is presenting a screening and Q&A. The 1983 fantasy film, directed by Jack Clayton, was based on a Ray Bradbury novel and its literary feel is clearly no accident. The title was taken from a line in Shakespeare's Macbeth (\"By the pricking of my thumbs/Something wicked this way comes\") and though it's not a traditional horror film, its air of dread lives up to its ominous name thanks to a stellar cast (Jason Robards, Jonathan Pryce, Diane Ladd and Pam Grier) and a creepy carnival backdrop. Mr. Dark's Pandemonium Carnival, with its haunting, time-warping carousel and requisite freaks and oddities, is more than it seems, and it'll take the will of two young boys to save everyone as the carnival sets its sinister sights on their town as winter and wickedness approach. If you've never seen this one, don't miss it. Q&A to follow will feature cast and crew members Darrell Rooney, Axel Hubert and Scott De Roy.", "url": "https://www.laweekly.com/event/something-wicked-this-way-comes-10076416", "orgName": null, "ticket_info": [{"lowestPrice": "12"}, {"highestPrice": "12"}], "id": "LAweekly_a67fdd9cab495b0eb26e0360a3a25b9b"}
