{"date_startDate": "2018-11-28", "date_endDate": "2018-11-28", "time_startTime": "18:00:00", "time_endTime": "21:00:00", "location_address": "1000 N. Alameda St.", "location_city": "Los Angeles", "location_name": "The California Endowment", "title": "KCET's CITY RISING: The Informal Economy Premiere and Panel Discussion", "description": "The California Endowment (TCE), in partnership with KCET, will be hosting a premiere screening event for KCET's CITY RISING: The Informal Economy. A new documentary series examining\nhow California workers who labor off the books are fighting for workers' rights. The series is a  follow up to KCET's City Rising documentary which launched in 2017 and focused on issues of gentrification and displacement in communities across California.\n\n\nCITY RISING: The Informal Economy is a new one-hour, multi-platform documentary that follows four California workers facing structural discrimination but fighting to change policy and improve upward mobility for their communities. From the urban\nneighborhoods and industrial corridors of Long Beach to the rural Coachella Valley, on-camera interviews with organizers, politicians and experts will contextualize labor in California, the world\u2019s fifth largest economy. The effects of this movement are\nfar reaching and their voices will ultimately impact the social health of communities across the country and beyond.\nPanel discussion to follow screening:\n\n\nAnanya Roy (Moderator), Professor of Urban Planning and Social Welfare, UCLA Luskin\n\n\nPascale Joassart-Marcelli, Professor of Geography and Director of the Interdisciplinary Urban Studies Program at SDSU\n\n\nCarla de Paz, Director of Community Organizing, East LA Community Corporation\n\n\nDanielle Mahones, Director, Leadership Development Program, UC Berkeley Labor Center", "url": "https://www.laweekly.com/event/kcets-city-rising-the-informal-economy-premiere-and-panel-discussion-10073601", "orgName": null, "ticket_info": [{"lowestPrice"